INSERT INTO `sys_help` VALUES (1,'admin','<h3 style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:22.5000pt;\nmargin-left:0.0000pt;text-indent:0.0000pt;padding:0pt 0pt 0pt 0pt ;\nmso-pagination:widow-orphan;mso-line-height-alt:12pt;\"><b><span style=\"font-family: Helvetica; color: rgb(105, 105, 105); letter-spacing: 0pt; font-size: 21pt;\">C2C法币交易须知</span></b><b><span style=\"font-family: Helvetica; color: rgb(105, 105, 105); letter-spacing: 0pt; font-size: 21pt;\"><o:p></o:p></span></b></h3><h3 style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:22.5000pt;\nmargin-left:0.0000pt;text-indent:0.0000pt;padding:0pt 0pt 0pt 0pt ;\nmso-pagination:widow-orphan;mso-line-height-alt:12pt;\"><p class=\"p\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">C2C交易打通了法币与数字货币的兑换通道，用户可以用法币(人民币/美元)购买数字货币，也可以在盈利后将数字货币售出，兑换成法币。</span><span style=\"mso-spacerun:\'yes\';font-family:Helvetica;color:rgb(116,119,122);\nletter-spacing:0.7500pt;font-size:12.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><span style=\"mso-spacerun:\'yes\';font-family:Helvetica;color:rgb(116,119,122);\nletter-spacing:0.7500pt;font-size:12.0000pt;mso-font-kerning:0.0000pt;\"><o:p>&nbsp;</o:p></span></p><p class=\"p\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><b><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">交易前提：通过实名认证</font>+设置资金密码+设置收付款账户。</span></b><span style=\"mso-spacerun:\'yes\';font-family:Helvetica;color:rgb(116,119,122);\nletter-spacing:0.7500pt;font-size:12.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><span style=\"mso-spacerun:\'yes\';font-family:Helvetica;color:rgb(116,119,122);\nletter-spacing:0.7500pt;font-size:12.0000pt;mso-font-kerning:0.0000pt;\"><o:p>&nbsp;</o:p></span></p><p class=\"p\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">1、买卖承兑商均通过实名认证，提供足额保证金(50万</span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">YNC</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">或</font>350万人民币)，且由平台托管数字资产，可以放心交易；</span><span style=\"mso-spacerun:\'yes\';font-family:Helvetica;color:rgb(116,119,122);\nletter-spacing:0.7500pt;font-size:12.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">2、法币交易区是用户与承兑商之间资产交易，资金不经转平台，平台也不接受人民币充值/汇款；</span><span style=\"mso-spacerun:\'yes\';font-family:Helvetica;color:rgb(116,119,122);\nletter-spacing:0.7500pt;font-size:12.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">3、承兑商服务时间为每天09:00-21:00，接单后30分钟内完成承兑，2小时未完成交易作废；</span><span style=\"mso-spacerun:\'yes\';font-family:Helvetica;color:rgb(116,119,122);\nletter-spacing:0.7500pt;font-size:12.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">4、法币交易区支持银行卡，禁止使用他人代付，ATM及柜台转账等，必须使用本人已实名认证的账户进行转账；</span><span style=\"mso-spacerun:\'yes\';font-family:Helvetica;color:rgb(116,119,122);\nletter-spacing:0.7500pt;font-size:12.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">5、每天最多只能发起5笔卖单和5笔买单，请合理安排；</span><span style=\"mso-spacerun:\'yes\';font-family:Helvetica;color:rgb(116,119,122);\nletter-spacing:0.7500pt;font-size:12.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">6、如您的交易24小时内未处理，请及时联系客服登记，待我们与承兑商确认后将联系您，请保持手机畅通；</span><span style=\"mso-spacerun:\'yes\';font-family:Helvetica;color:rgb(116,119,122);\nletter-spacing:0.7500pt;font-size:12.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><span style=\"mso-spacerun:\'yes\';font-family:Helvetica;color:rgb(116,119,122);\nletter-spacing:0.7500pt;font-size:12.0000pt;mso-font-kerning:0.0000pt;\"><o:p>&nbsp;</o:p></span></p><p class=\"p\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">申请成为承兑商：</font>apply@QIBIT.io</span><span style=\"mso-spacerun:\'yes\';font-family:Helvetica;color:rgb(116,119,122);\nletter-spacing:0.7500pt;font-size:12.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><span style=\"mso-spacerun:\'yes\';font-family:Helvetica;color:rgb(116,119,122);\nletter-spacing:0.7500pt;font-size:12.0000pt;mso-font-kerning:0.0000pt;\"><o:p>&nbsp;</o:p></span></p><p class=\"p\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><b><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\"><font face=\"Helvetica\">附：关于（</font></span></b><b><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\">YNC</span></b><b><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\"><font face=\"Helvetica\">）</font>— </span></b><b><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\"><font face=\"宋体\">一诺</font></span></b><b><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\"><font face=\"Helvetica\">币</font></span></b><span style=\"mso-spacerun:\'yes\';font-family:Helvetica;color:rgb(116,119,122);\nletter-spacing:0.7500pt;font-size:12.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><span style=\"mso-spacerun:\'yes\';font-family:Helvetica;color:rgb(116,119,122);\nletter-spacing:0.7500pt;font-size:12.0000pt;mso-font-kerning:0.0000pt;\"><o:p>&nbsp;</o:p></span></p><p class=\"p\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">YNC</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">是</font></span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">QIBIT</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">公司推出的基于稳定价值</font></span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"宋体\">货币人民币</font></span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">（</font></span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">CNY</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">）的代币</font></span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">YNC</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">（下称</font></span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">YNC</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">），</font>1</span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">YNC</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">=1</span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"宋体\">人民币</font></span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">，用户可以随时使用</font></span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">YNC</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">与</font></span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">CNY</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">进行</font>1:1兑换。</span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">QIBIT</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">公司严格遵守</font>1:1准备金保证，即每发行1个 </span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">YNC</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">代币，其银行账户都会有</font>1</span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"宋体\">人民币</font></span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">的资金保障。</font></span><span style=\"mso-spacerun:\'yes\';font-family:Helvetica;color:rgb(116,119,122);\nletter-spacing:0.7500pt;font-size:12.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><span style=\"mso-spacerun:\'yes\';font-family:Helvetica;color:rgb(116,119,122);\nletter-spacing:0.7500pt;font-size:12.0000pt;mso-font-kerning:0.0000pt;\"><o:p>&nbsp;</o:p></span></p><p class=\"p\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp; &nbsp; &nbsp; &nbsp;用户可以在</span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">QIBIT</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">平台进行资金查询，以保障透明度。用户可以通过</font></span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"宋体\">汇款人民币</font></span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">至</font></span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">QIBIT</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">公司提供的银行帐户，或通过交易所换取</font></span><span style=\"font-family: 宋体; color: rgb(1