0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\">⑤、订单完成！</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-fareast-font-family:宋体;\nmso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;mso-font-kerning:0.0000pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin-top:0.0000pt;margin-right:72.0000pt;margin-bottom:0.0000pt;\nmargin-left:72.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;\"><span style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-fareast-font-family:宋体;\nmso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;mso-font-kerning:0.0000pt;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0pt 72pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\"><font face=\"Helvetica\">注意一：买入</font></span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\">YNC</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\"><font face=\"Helvetica\">时，请在承兑商接单后</font>30分钟完成付款，否则将自动取消订单；</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0pt 36pt 0pt 66pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\"><font face=\"Helvetica\">注意二、买入和卖出时，会自动冻结承兑商和用户订单数量的</font></span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\">YNC</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\"><font face=\"Helvetica\">；</font></span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0pt 36pt 0pt 66pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\"><font face=\"Helvetica\">注意三、请勿频繁恶意下单，否则平台将对恶意下单账户进行冻结</font>/禁止交易的操作；</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-fareast-font-family:宋体;\nmso-bidi-font-family:\'Times New Roman\';font-size:10.5000pt;mso-font-kerning:1.0000pt;\"><o:p>&nbsp;</o:p></span></p></h3>','2020-09-19 06:53:42','',NULL,10,0,2,'C2C法币交易须知','CN'),(2,'admin','<p>如您在QIBIT（QIBIT.io）已完成提币转账申请操作，但提币仍未到账时，您可进行以下查验操作：</p><p><br></p><p><br></p><p><br></p><p>1、进入“个人中心”→“资产管理”→“提币”→“提币记录”中查看您的转账Transaction ID（TXID）。同时，生成Transaction ID（TXID）即代表QIBIT已为您完成提币转账操作，区块网络已接收到您的提币转账申请;</p><p><br></p><p><br></p><p><br></p><p>2、在区块浏览器上通过Transaction ID（TXID）查看区块确认数;</p><p><br></p><p><br></p><p><br></p><p>3、具体到账时间请您咨询您的提币入账方;</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p>特别注意：</p><p><br></p><p><br></p><p><br></p><p>出于用户资金安全考虑，提现金额较大时会需要人工审核，人工审核无误后订单会被放行，请您耐心等待。若2小时后在您账户的“提币记录”中仍然没有Transaction ID（TXID）生成，请联系官方客服并提供：您的账户，提币种类数量，提现历史中该笔转账的截图。</p><p><br></p><p><br></p><p><br></p><p>&nbsp;</p><p><br></p><p><br></p><p><br></p><p>附件：部分币种区块确认数查询网站</p><p><br></p><p><br></p><p><br></p><p>USDT、BTC：https://btc.com/</p><p><br></p><p><br></p><p><br></p><p>ETH及ERC20币种：https://etherscan.io/</p><p><br></p><p><br></p><p><br></p><p>莱特币：https://chainz.cryptoid.info/ltc/</p><p><br></p><p><br></p><p><br></p><p>以太经典：http://gastracker.io/</p><p><br></p><p><br></p><p><br></p><p>BCH：https://bch.btc.com/</p><p><br></p><p><br></p><p><br></p><p>XRP：https://bithomp.com/explorer/</p><p><br></p>','2020-09-19 06:55:51','',NULL,10,0,1,'提币未到账怎么办？','CN'),(3,'admin','<p>币种概况</p><p><br></p><p><br></p><p><br></p><p>发行时间： 2008-11-01</p><p><br></p><p>最大供应量： 21,000,000 BTC</p><p><br></p><p>总供应量： 17,811,737 BTC</p><p><br></p><p>核心算法： SHA256</p><p><br></p><p>激励机制： POW</p><p><br></p><p><br></p><p><br></p><p>币种简介</p><p><br></p><p><br></p><p><br></p><p>比特币（BitCoin）的概念最初由中本聪在2008年提出，根据中本聪的思路设计发布的开源软件以及建构其上的P2P网络。比特币是一种P2P形式的数字货币。点对点的传输意味着一个去中心化的支付系统。</p><p><br></p><p><br></p><p><br></p><p>与大多数货币不同，比特币不依靠特定货币机构发行，它依据特定算法，通过大量的计算产生，比特币经济使用整个p2p网络中众多节点构成的分布式数据库来确认并记录所有的交易行为，并使用密码学的设计来确保货币流通各个环节安全性。</p><p><br></p><p><br></p><p><br></p><p>p2p的去中心化特性与算法本身可以确保无法通过大量制造比特币来人为操控币值。基于密码学的设计可以使比特币只能被真实的拥有者转移或支付。这同样确保了货币所有权与流通交易的匿名性。比特币与其他虚拟货币最大的不同，是其总数量非常有限，具有极强的稀缺性。该货币系统曾在4年内只有不超过1050万个，之后的总数量将被永久限制在2100万个。</p><p><br></p><p>&nbsp;</p><p><br></p><p>比特，是一种计算机专业术语，是信息量单位，是由英文BIT音译而来。二进制数的一位所包含的信息就是一比特，如二进制数0100就是4比特。那么，比特这个概念和货币联系到一起，不难看出，比特币非现实货币，而是一种计算机电子虚拟货币，存储在你的电脑上。</p><p><br></p><p><br></p><p><br></p><p>目前，这种崭新的虚拟货币不受任何政府、任何银行控制。因此，它还未被合法化。</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p>如何得到比特币</p><p><br></p><p><br></p><p><br></p><p>&nbsp; &nbsp; &nbsp; 如果你对它产生兴趣，你不仅可以在交易市场买到比特币，在很早期，比特币算力难度非常低时，还可以使用计算机依照算法进行大量的运算来“开采”比特币。</p><p><br></p><p>&nbsp; &nbsp; &nbsp; 在用户“开采”比特币时，需要用电脑搜寻64位的数字就行，然后通过反 复解谜与其他淘金者相互竞争，为比特币网络提供所需的数字，如果用户的电脑成功地创造出一组数字，那么就将会获得区块所奖励的比特币。&nbsp; &nbsp;</p><p><br></p><p>&nbsp; &nbsp; &nbsp; 但是由于比特币价值不断升高，目前比特币挖矿的用户数量非常庞大，有上百万的专业矿机在同时挖矿，而每10分钟产出的比特币又十分有限，形成了千万人抢1个区块的情况出现，所以，如果你用个人电脑单独挖矿，有可能一整年也抢不到一个区块，在这种情况下，人们就想出了一种组队挖矿的方法，于是矿池(mining pool)诞生了。</p><p><br></p><p>&nbsp; &nbsp; &nbsp; 矿池是一个通过特定算法而设计的服务器，所有连接到矿池服务器的用户，会组队进行挖矿，个人电脑的性能虽然渺小，但是成千上万的人进行组队挖矿，总体性能就会变得十分强大，在这种情况，挖矿的成功率会大大提升，一旦矿池中的队伍成功制造了一个区块，那么所有队伍中的人会根据每个人的电脑性能进行分红。</p><p><br></p><p>&nbsp; &nbsp; &nbsp; 比特币目前全网算力56.48 EH/s，全网难度7,409,399,249,090 - 7.41 T，每T收益1T * 24H = 0.00003394 BTC（2019年6月20日数据）。</p><p><br></p><p>&nbsp; &nbsp; &nbsp; 预计到2020-05-05，比特币产量会减半，而到2140年，流通的比特币上限将会达到2100万。换句话说，比特币系统是能够实现自给自足的，通过编码来抵御通胀，并防止他人对这些代码进行破坏。</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p>比特币的特点</p><p><br></p><p><br></p><p><br></p><p>去中心化</p><p><br></p><p>比特币是第一种分布式的虚拟货币，整个网络由用户构成，没有中央银行。去中心化是比特币安全与自由的保证。</p><p><br></p><p><br></p><p><br></p><p>全世界流通</p><p><br></p><p>比特币可以在任意一台接入互联网的电脑上管理。不管身处何方，任何人都可以挖掘、购买、出售或收取比特币</p><p><br></p><p><br></p><p><br></p><p>专属所有权</p><p><br></p><p>操控你的比特币需要你的私钥，它可以被隔离保存在任何存储介质。除了你之外无人可以获取。</p><p><br></p><p><br></p><p><br></p><p>低交易费用</p><p><br></p><p>目前可以免费汇出比特币，但最终对每笔交易将收取约1比特分的交易费以确保交易更快执行。关于交易费的详情。</p><p><br></p><p><br></p><p><br></p><p>无隐藏成本</p><p><br></p><p>作为由A到B的支付手段，比特币没有繁琐的额度与手续限制。知道对方比特币地址就可以进行支付。</p><p><br></p><p><br></p><p><br></p><p>跨平台挖掘</p><p><br></p><p>比特币是技术人士的热爱！可以在众多平台上发掘不同硬件的计算能力。非小号的极客用户们应该会很有同感：这本身已构成一种乐趣。</p><p><br></p><p><br></p><p><br></p><p><br></p><p>比特币Q&amp;A</p><p><br></p><p><br></p><p><br></p><p>比特币是如何运作的?</p><p><br></p><p>比特币使用了公开密钥系统。每一个钱币都包括了其拥有者的公开密匙。当钱币从用户A支付给用户B时, A将B的公开密匙添加到钱币中, 然后这个钱币又被A用私人密码匙来签封。B现在即拥有了这个钱币并且可以将来使用，而A就不可能再次使用这个钱币，因为以前的交易记录以被全体网络计算机收录维护。在每笔交易前，钱币的有效性都必须经过检验确认。</p><p><br></p><p>&nbsp;</p><p><br></p><p>比特币值多少钱？</p><p><br></p><p>在比特币刚诞生的时候，几乎一文不值，1美元平均能够买到1309.03个比特币，但比特币价格曾一度飙升至15000美元，感兴趣的朋友可以在非小号网站，了解比特币的实时行情。</p><p><br></p><p>&nbsp;</p><p><br></p><p>比特币能否兑换现金？</p><p><br></p><p>答案是肯定的。你只需与比特币交易机构取得联系即可完成兑换。币严BIZZAN即将开通法币兑换OTC服务，届时在BIZZAN即可完成一站式买卖比特币。</p><p><br></p><p>&nbsp;</p><p><br></p><p>比特币是匿名的吗？</p><p><br></p><p>比特币不是匿名的，相反，严格来讲，比特币是完全公开而且可追踪的。与其说比特币是匿名，不如说是非实名的。举个例子，如果在非小号上，你不用真名注册，不填写个人信息，你的唯一代号是你的id，这叫非实名；你发帖选择匿名用户，这才叫匿名。</p><p><br></p><p><br></p><p>在比特币世界里的地址的所有转账记录都可追踪，简单说，如果你从交易所转一笔钱到比特币，然后拿来黑市交易，不管你进行多少次交易，想查的话很快就能查到你钱的来路从而追踪到你。就如同你用同样的ID上非小号，只要你暴露过个人信息，总能人肉到你。</p><p><br></p><p>所以比特币不是匿名的，而是非实名。</p><p><br></p><p><br></p><p><br></p><p>真正的匿名的有门罗币（XMR）、大零币（ZEC）、达世币（DASH）等，非小号一共收录了40种匿名货币，其中XMR，DASH，ZEC产生较早，市值较大，应用较广，并称为三大匿名货币。大家可以点击进行比较哦。</p><p><br></p><p><br></p><p><br></p><p>比特币能做什么？</p><p><br></p><p>智能合约、信息公开、投资避险、支付汇款、炒作标的、价值储存、货币发行与社会公平、洗钱、赌博等，哦对了，还有买披萨。</p><p><br></p><p>&nbsp;</p><p><br></p><p>为何要关注比特币？</p><p><br></p><p>比特币代表了一种完全匿名而且无需成本的交易方式，比特币不属于任何国家，并且不受地域限制，是一种用户能够随时随地进行自由兑换的货币。对于这种新鲜且前景一片大好的货币形式，我们没有理由不去关注它。</p><p><br></p><p>&nbsp;</p><p><br></p><p>比特币交易合法吗？</p><p><br></p><p>2013 年 12 月，中国人民银行等五部委联合发布的《关于防范比特币风险的通知》中，禁止金融机构介入比特币，但同时认为：</p><p><br></p><p>“比特币是一种特定的虚拟商品，不具有与货币等同的法律地位，不能且不应作为货币在市场上流通使用。但是，比特币交易作为一种互联网上的商品买卖行为，普通民众在自担风险的前提下拥有参与的自由。”</p><p><br></p><p>根据国家相关法律法规，买卖比特币是属于合法的。</p><p><br></p><p>据目前五部委的声明，比特币是商品，是交易合法的。</p><p><br></p><p>相关链接</p><p><br></p><p>官方网址：https://bitcoin.org/</p><p>白皮书：http://www.bitcoin.org/bitcoin.pdf</p><p>区块浏览器①：https://www.blockchain.com/explorer</p><p>区块浏览器②：https://blockexplorer.com/</p><p>区块浏览器③：https://btc.com/</p><p>区块浏览器④：https://blockchair.com/bitcoin/blocks</p>','2020-09-19 06:56:52','',NULL,10,0,3,'BTC-比特币（Bitcoin）简介','CN'),(4,'admin','<p>币种概况</p><p><br></p><p><br></p><p><br></p><p>发行时间 2014-07-24</p><p><br></p><p>最大供应量 106,856,137 ETH</p><p><br></p><p>总供应量 106,856,137 ETH</p><p><br></p><p>核心算法 Ethash</p><p><br></p><p>激励机制 POW+POS</p><p><br></p><p><br></p><p><br></p><p>币种简介</p><p><br></p><p><br></p><p><br></p><p>Ethereum（以太坊）是一个平台和一种编程语言，使开发人员能够建立和发布下一代分布式应用。 Ethereum可以用来编程，分散，担保和交易任何事物：投票，域名，金融交易所，众筹，公司管理， 合同和大部分的协议，知识产权，还有得益于硬件集成的智能资产。</p><p><br></p><p><br></p><p><br></p><p>以太坊将使用混合型的安全协议，前期使用工作量证明机制（POW），用于分发以太币，然后会切换到权益证明机制（POS）。自上线时起，每年都将有0.26x，即每年有60102216 * 0.26 = 15626576个以太币被矿工挖出。转成POS后，每年产出的以太币将减少。</p><p><br></p><p>&nbsp;</p><p><br></p><p>以太坊的产生背景</p><p><br></p><p>&nbsp;</p><p><br></p><p>比特币开创了去中心化密码货币的先河，五年多的时间充分检验了区块链技术的可行性和安全性。比特币的区块链事实上是一套分布式的数据库，如果再在其中加进一个符号——比特币，并规定一套协议使得这个符号可以在数据库上安全地转移，并且无需信任第三方，这些特征的组合完美地构造了一个货币传输体系——比特币网络。</p><p><br></p><p><br></p><p><br></p><p>然而比特币并不完美，其中协议的扩展性是一项不足，例如比特币网络里只有一种符号——比特币，用户无法自定义另外的符号，这些符号可以是代表公司的股票，或者是债务凭证等，这就损失了一些功能。另外，比特币协议里使用了一套基于堆栈的脚本语言，这语言虽然具有一定灵活性，使得像多重签名这样的功能得以实现，然而却不足以构建更高级的应用，例如去中心化交易所等。以太坊从设计上就是为了解决比特币扩展性不足的问题。</p><p><br></p><p>&nbsp;</p><p><br></p><p>以太坊开启“区块链2.0时代”</p><p><br></p><p>&nbsp;</p><p><br></p><p>区块链技术是比特币的底层技术，这一技术第一次被描述是在中本聪2008年发表的白皮书“比特币：点对点电子现金系统”中。区块链技术更多的一般性用途在原书中已经有所讨论，但直到几年后，区块链技术才作为通用术语出现。一个区块链是一个分布式计算架构，里面的每个网络节点执行并记录相同的交易，交易被分组为区块。一次只能增加一个区块，每个区块有一个数学证明来保证新的区块与之前的区块保持先后顺序。这样一来，区块链的“分布式数据库”就能和整个网络保持一致。个体用户与总账的互动（交易）受到安全的密码保护。由数学执行并编码到协议中的经济激励因素刺激着维持和验证网络的节点。</p><p><br></p><p><br></p><p>在比特币中，分布式数据库被设想为一个账户余额表，一个总账，交易就是通过比特币的转移以实现个体之间无需信任基础的金融活动。但是随着比特币吸引了越来越多开发者和技术专家的注意，新的项目开始将比特币网络用于有价代币转移之外的其他用途。其中很多都采用了“代币”的形式——以原始比特币协议为基础，增加了新的特征或功能，采用各自加密货币的独立区块链。在2013年末，以太坊的发明者Vitalik Buterin（被圈内人尊称为“V神”）建议能够通过程序重组来运行任意复杂运算的单个区块链应该包含其他的程序。</p><p><br></p><p><br></p><p><br></p><p>2014年，以太坊的创始人Vitalik Buterin, Gavin Wood和Jeffrey Wilcke开始研究新一代区块链，试图实现一个总体上完全无需信任基础的智能合约平台。</p><p><br></p><p><br></p><p><br></p><p>以太坊的最高峰时期，大家可以从行情图上看到以太坊在2018年年初曾高达＄1506，这是因为当时数以万计的项目都靠以太坊来进行发币（也就是ICO狂潮时期），所有使用以太坊智能合约发币的又被大家称为“山寨币”，可以说没有以太坊的诞生，就没有成千上万的区块链项目，所以以太坊是名副其实地开启了“区块链2.0时代”。</p><p><br></p><p><br></p><p><br></p><p>基于以太坊开发的区块链项目，比较具有代表性的有：唯链（VET）、Augur（REP）、Zilliqa (ZIL)、LoopringCoin V2 (LRC)等等。</p><p><br></p><p>&nbsp;</p><p><br></p><p>以太坊的工作原理</p><p><br></p><p>&nbsp;</p><p><br></p><p>以太坊是一个平台，它上面提供各种模块让用户来搭建应用，如果将搭建应用比作造房子，那么以太坊就提供了墙面、屋顶、地板等模块，用户只需像搭积木一样把房子搭起来，因此在以太坊上建立应用的成本和速度都大大改善。具体来说，以太坊通过一套图灵完备的脚本语言（Ethereum Virtual Machine code，简称EVM语言）来建立应用，它类似于汇编语言，我们知道，直接用汇编语言编程是非常痛苦的，但以太坊里的编程并不需要直接使用EVM语言，而是类似C语言、Python、Lisp等高级语言，再通过编译器转成EVM语言。</p><p><br></p><p><br></p><p><br></p><p>上面所说的平台之上的应用，其实就是合约，这是以太坊的核心。合约是一个活在以太坊系统里的自动代理人，他有一个自己的以太币地址，当用户向合约的地址里发送一笔交易后，该合约就被激活，然后根据交易中的额外信息，合约会运行自身的代码，最后返回一个结果，这个结果可能是从合约的地址发出另外一笔交易。需要指出的是，以太坊中的交易，不单只是发送以太币而已，它还可以嵌入相当多的额外信息。如果一笔交易是发送给合约的，那么这些信息就非常重要，因为合约将根据这些信息来完成自身的业务逻辑。</p><p><br></p><p><br></p><p><br></p><p>合约所能提供的业务，几乎是无穷无尽的，它的边界就是你的想象力，因为图灵完备的语言提供了完整的自由度，让用户搭建各种应用。白皮书举了几个例子，如储蓄账户、用户自定义的子货币等。</p><p><br></p><p><br></p><p><br></p><p>以太坊的技术原理</p><p><br></p><p><br></p><p><br></p><p>以太坊合并了很多对比特币用户来说十分熟悉的特征和技术，同时自己也进行了很多修正和创新。比特币区块链纯粹是一个关于交易的列表，而以太坊的基础单元是账户。以太坊区块链跟踪每个账户的状态，所有以太坊区块链上的状态转换都是账户之间价值和信息的转移。账户分为两类：</p><p><br></p><p><br></p><p><br></p><p>外部账户（EOA），由私人密码控制</p><p>合约账户，由它们的合约编码控制，只能由外部账户“激活”</p><p>&nbsp;</p><p><br></p><p>对于大部分用户来说，两者基本的区别在于外部账户是由人类用户掌控——因为他们能够控制私钥，进而控制外部账户。而合约账户则是由内部编码管控。如果他们是被人类用户“控制”的，那也是因为程序设定它们被具有特定地址的外部账户控制，进而被持有私钥控制外部账户的人控制着。“智能合约”这个流行的术语指的是在合约账户中编码——交易被发送给该账户时所运行的程序。用户可以通过在区块链中部署编码来创建新的合约。</p><p><br></p><p><br></p><p><br></p><p>只有当外部账户发出指令时，合约账户才会执行相应的操作。所以合约账户不可能自发地执行诸如任意数码生成或应用程序界面调用等操作--只有受外部账户提示时，它才会做这些事。这是因为以太坊要求节点能够与运算结果保持一致，这就要求保证严格确定执行。</p><p><br></p><p><br></p><p><br></p><p>和比特币一样，以太坊用户必须向网络支付少量交易费用。这可以使以太坊区块链免受无关紧要或恶意的运算任务干扰，比如分布式拒绝服务（DDoS）攻击或无限循环 。交易的发送者必须在激活的“程序”每一步付款，包括运算和记忆储存。费用通过以太坊自有的有价代币，以太币的形式支付。</p><p><br></p><p><br></p><p><br></p><p>交易费用由节点收集，节点使网络生效。这些“矿工”就是以太坊网络中收集、传播、确认和执行交易的节点。矿工们将交易分组——包括许多以太坊区块链中账户“状态”的更新——分成的组被称为“区块”，矿工们会互相竞争，以使他们的区块可以添加到下一个区块链上。矿工们每挖到一个成功的区块就会得到以太币奖励。这就为人们带来了经济激励，促使人们为以太坊网络贡献硬件和电力。</p><p><br></p><p><br></p><p><br></p><p>和比特币网络一样，矿工们有解决复杂数学问题的任务以便成功地“挖”到区块。这被称为“工作量证明”。一个运算问题，如果在算法上解决，比验证解决方法需要更多数量级的资源，那么它就是工作证明的极佳选择。为防止比特币网络中已经发生的，专门硬件（例如特定用途集成电路）造成的中心化现象，以太坊选择了难以存储的运算问题。如果问题需要存储器和CPU，事实上理想的硬件是普通的电脑。这就使以太坊的工作量证明具有抗特定用途集成电路性，和比特币这种由专门硬件控制挖矿的区块链相比，能够带来更加去中心化的安全分布。</p><p><br></p><p>相关链接</p><p><br></p><p>官方网址：https://www.ethereum.org/</p><p>白皮书：https://github.com/ethereum/wiki/wiki/White-Paper</p><p>区块浏览器①：https://www.yitaifang.com/</p><p>区块浏览器②：https://etherscan.io/</p><p>区块浏览器③：https://ethplorer.io/</p><p>区块浏览器④：https://etherchain.org/</p><div><br></div>','2020-09-19 06:57:19','',NULL,11,0,3,'ETH-以太坊（Ethereum）简介','CN'),(5,'admin','<p>市价交易分为市价买入与市价卖出：</p><p><br></p><p><br></p><p><br></p><p>【市价买入】</p><p><br></p><p>即根据已有的挂单进行成交，如果你要求以市价买入，你会优先和卖1成交，如果卖1的挂单成交完了还未达到你委托的买入量，则和卖2成交，如果还未达到委托量，再和卖3成交，以此类推。</p><p><br></p><p><br></p><p><br></p><p>【市价卖出】</p><p><br></p><p>同样的道理，先和买1成交，未达到委托量，再分别和买2、买3、买4成交，直到达到委托量为止。</p><p><br></p><p><br></p><p><br></p><p>市价成交也被称为“吃单”，因为形象上就是把别人挂的买一卖一、买二卖二“吃掉”。当然，用远高于卖1的限价委托买入或者用远低于买1的限价委托卖出也能够达到“吃单”的效果。</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p>举例，假如当前盘面如下：</p><p><br></p><p><br></p><p><br></p><p>-------------价格-----挂单数----</p><p><br></p><p>卖5:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;25&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2</p><p><br></p><p>卖4:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;24&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2</p><p><br></p><p>卖3:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;23&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3</p><p><br></p><p>卖2:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;22&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2</p><p><br></p><p>卖1:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;21&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2</p><p><br></p><p>----------------------------------</p><p><br></p><p>最新成交价：9.1</p><p><br></p><p>----------------------------------</p><p><br></p><p>买1:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;20&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1</p><p><br></p><p>买2:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;19&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2</p><p><br></p><p>买3:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;18&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3</p><p><br></p><p>买4:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;17&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2</p><p><br></p><p>买5:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;16&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3</p><p><br></p><p>-------------价格-----挂单数----</p><p><br></p><p><br></p><p><br></p><p>一、小王假如挂100usdt的市价买单，那么小王的委托将会得到以下成交结果：</p><p><br></p><p><br></p><p><br></p><p>21usdt，成交&nbsp; &nbsp;2个 = 42usdt</p><p><br></p><p>22usdt，成交&nbsp; &nbsp;2个 = 44usdt</p><p><br></p><p>23usdt，成交0.6个 = 14usdt</p><p><br></p><p><br></p><p><br></p><p>也就是说，小王用100usdt买到了4.6个币，成交均价为100/4.6 = 21.73 usdt</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p>二、小王如挂7个币的市价卖单，那么小王的市价委托将得到如下成交结果：</p><p><br></p><p><br></p><p><br></p><p>20usdt，成交&nbsp; &nbsp; &nbsp;1个&nbsp; =&nbsp; 20usdt</p><p><br></p><p>19usdt，成交&nbsp; &nbsp; &nbsp;2个&nbsp; =&nbsp; 38usdt</p><p><br></p><p>18usdt，成交&nbsp; &nbsp; &nbsp;3个&nbsp; =&nbsp; 54usdt</p><p><br></p><p>17usdt，成交&nbsp; &nbsp; &nbsp;1个&nbsp; =&nbsp; 17usdt</p><p><br></p><p><br></p><p><br></p><p>也就是说，小王通过卖出7个币，得到了20+38+54+17 = 129usdt</p><p><br></p><p><br></p><p><br></p><p>特别提醒：</p><p>请谨慎操作市价卖单与市价卖单，当市场交易深度足够时，市价订单可能会以较为接近当前价格成交，但当市场深度不足时，很可能会发生天价成交或地价成交的情况。</p>','2020-09-19 06:59:02','',NULL,11,0,2,'什么是市价交易？','CN'),(6,'admin','<div class=\"image-desc\" style=\"text-align: center; color: #333;\"><br></div><div class=\"image-desc\" style=\"text-align: center;\"><div class=\"image-desc\" style=\"\"><font color=\"#333333\">限价交易分为限价买入与限价卖出：</font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\">Limit Buy = 限价买入 ---- 限定必须以等于或低于指定价格的价格成交</font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\">例子：比特币现价是12000usdt，小编预计未来行情会跌到11000usdt然后开始反弹走高，那么小编就在11000做挂单，这时就用限价买入，这时只有当比特币价格跌到11000或低于11000，小编的挂单才会成交。</font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\">注意：挂限价买入单时，如果下单价高于当前现价，那么如有合适卖单对应，则会直接成交；如下单价低于当前现价，则下单当时不会有任何成交，直到价格下跌到下单价时才会成交。</font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\">Limit Sell = 限阶卖出 ---- 限定必须以等于或高于指定价格的价格成交</font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\">例子：比特币现价是12000usdt，小编预计未来行情会涨到16000usdt到顶，然后开始下跌，那么小编就在16000做挂单，这时就用限价卖出。这时只有当比特币价格涨到16000或高于16000，小编的挂单才会成交。</font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\" style=\"\"><font color=\"#333333\">注意：挂限价卖出单时，如果下单价高于当前现价，那么下单当时不会有任何成交；如下单价低于当前现价，则下单当时如有合适的买入订单则会成交。</font></div><div class=\"image-desc\" style=\"color: rgb(51, 51, 51);\"><br></div></div>','2020-09-19 07:00:44','',NULL,13,0,2,'什么是限价交易？','CN'),(7,'admin','<p>风险提示</p><p><br></p><p><br></p><p><br></p><p>1. 数字资产涉及重大风险，市场交易不确定性因素较多。同时由于数字货币总市值普遍偏少，价格易受到庄家控制以及全球各政府政策的影响而出现大幅波动。由于价格波动，您可能会有大额的盈利或亏损。任何数字资产都可能发生大幅度波动，甚至可能变得毫无价值。</p><p><br></p><p><br></p><p><br></p><p>2.因各国法律、法规和规范性文件的制定或者修改，数字资产交易随时可能被暂停、或被禁止，用户使用QIBIT服务时请自行根据当地法律法规、政策性文件评估风险。</p><p><br></p><p><br></p><p><br></p><p>3.用户参与数字资产交易，应当根据自己财务状况，仔细考虑、评估数字资产投资价值和投资风险，自行控制交易风险，并承担可能损失全部投资的经济风险。</p><p><br></p><p><br></p><p><br></p><p>法律声明</p><p><br></p><p><br></p><p><br></p><p>一、权利归属</p><p><br></p><p><br></p><p><br></p><p>除非QIBIT另行声明，QIBIT内的所有产品、技术、软件、程序、数据及其他信息（包括文字、图标、图片、照片、音频、视频、图表、色彩组合、版面设计等）的所有权利（包括版权、商标权、专利权、商业秘密及其他相关权利）均归QIBIT服务提供者及/或其关联公司所有。未经QIBIT服务提供者及/或其关联公司许可，任何人不得以包括通过机器人、蜘蛛等程序或设备监视、复制、传播、展示、镜像、上载、下载等方式擅自使用QIBIT内的任何内容。</p><p><br></p><p><br></p><p><br></p><p>QIBIT文字及标识，以及QIBIT的其他标识、徽记、产品和服务名称均为QIBIT服务提供者及/或其关联公司商标，如有宣传、展示等任何使用需要，您必须取得QIBIT服务提供者及/或其关联公司事先书面授权。</p><p><br></p><p><br></p><p><br></p><p>二、责任限制</p><p><br></p><p><br></p><p><br></p><p>鉴于QIBIT系提供一个包含数字资产的在线交易平台，用于交易数字资产和衍生品。QIBIT作为“网络服务提供者”的第三方平台，不担保网站平台上的信息及服务能充分满足用户的需求。QIBIT转载的作品（包括用户评论）出于传递更多信息之目的，并不意味我们赞同其观点或已经证实其内容的真实性。&nbsp;</p><p><br></p><p><br></p><p><br></p><p>1、用户理解并同意，QIBIT的服务是按照现有技术和条件所能达到的现状提供的。QIBIT会尽最大努力向用户提供服务，确保服务的连贯性和安全性；但QIBIT不能随时预见和防范法律、技术以及其他风险，包括但不限于不可抗力、病毒、木马、黑客攻击、系统不稳定、第三方服务瑕疵、政府行为等原因可能导致的服务中断、数据丢失以及其他的损失和风险。QIBIT因下列情形无法正常运作，致使用户无法使用各项服务时，QIBIT将免于承担任何损害赔偿责任，该情形包括但不限于：</p><p><br></p><p><br></p><p><br></p><p>1）．QIBIT平台公告之系统停机维护期间；</p><p><br></p><p><br></p><p><br></p><p>2）．电信设备出现故障不能进行数据传输的；</p><p><br></p><p><br></p><p><br></p><p>3）．因台风、地震、海啸、洪水、停电、战争、恐怖袭击等不可抗力之因素，造成QIBIT平台系统障碍不能正常运作的；</p><p><br></p><p><br></p><p><br></p><p>4）．由于黑客攻击、计算机病毒侵入或发作、电信部门技术调整或故障、网站升级、银行方面的问题、因政府管制而造成的暂时性关闭等影响网络正常经营的原因而造成的服务中断或者延迟；</p><p><br></p><p><br></p><p><br></p><p>5）．因为行业现有技术力量无法预测或无法解决的技术问题而造成的损失；</p><p><br></p><p><br></p><p><br></p><p>6）．因第三方的过错或者延误而给用户或者其他第三方造成的损失。</p><p><br></p><p><br></p><p><br></p><p>由于系统故障，网络原因，DDos等黑客攻击等意外因素可能导致的异常成交，行情中断，以及其他可能的异常情况，QIBIT有权根据实际情况取消异常成交结果，以及回滚某一段时间的所有成交。</p><p><br></p><p><br></p><p><br></p><p>2.、用户在使用QIBIT服务时已充分了解交易风险并同意在任何情况下，QIBIT就以下各事项不承担任何赔偿责任：</p><p><br></p><p><br></p><p><br></p><p>1)收入的损失；</p><p><br></p><p><br></p><p><br></p><p>2)交易利润或合同损失；</p><p><br></p><p><br></p><p><br></p><p>3)业务中断；</p><p><br></p><p><br></p><p><br></p><p>4)预期可节省的货币的损失；</p><p><br></p><p><br></p><p><br></p><p>5)信息的损失；</p><p><br></p><p><br></p><p><br></p><p>6)机会、商誉或声誉的损失；</p><p><br></p><p><br></p><p><br></p><p>7)数据的损坏或损失；</p><p><br></p><p><br></p><p><br></p><p>8)购买替代产品或服务的成本；</p><p><br></p><p><br></p><p><br></p><p>9)数字资产消亡或退出市场。</p>','2020-09-19 07:05:46','',NULL,1,0,5,'免责声明','CN'),(8,'admin','<p>一、双方</p><p><br></p><p><br></p><p><br></p><p>1.1 QIBIT LTD.（以下称 “公司”）是一家根据开曼群岛法律在开曼群岛注册成立的公司，该公司运营网站http://www.QIBIT.io（以下称“本网站”或“网站”），该网站是一个专门供用户进行数字资产交易和提供相关服务（以下称“该服务”或“服务”）的平台。为了本协议表述之方便，公司和该网站在本协议中合称使用“我们”或其他第一人称称呼。</p><p><br></p><p><br></p><p><br></p><p>1.2 只要登陆该网站的自然人或其他主体均为本网站的用户，本协议表述之便利，以下使用“您”或其他第二人称。</p><p><br></p><p><br></p><p><br></p><p>1.3 为了本协议表述之便利，我们和您在本协议中合称为“双方”，我们或您单称为“一方”。</p><p><br></p><p><br></p><p><br></p><p>&nbsp;</p><p><br></p><p><br></p><p><br></p><p>二、隐私政策制定的目的</p><p><br></p><p><br></p><p><br></p><p>隐私政策规定了我们只通过您登陆本网站、在本网站上注册和/或使用我们提供的服务采集您信息的类型以及我们如何使用和保护这些采集到的信息。</p><p><br></p><p><br></p><p><br></p><p>&nbsp;</p><p><br></p><p><br></p><p><br></p><p>三、您的同意</p><p><br></p><p><br></p><p><br></p><p>为确保您对我们在处理个人资料上有充分信心, 您切要详细阅读及理解隐私政策的条文。特别是您一旦登陆我们的网站，不论您是否在该网站上注册，您均向我们表明您接受、同意、承诺和确认：</p><p><br></p><p><br></p><p><br></p><p>3.1 您在自愿下连同所需的同意向我们披露个人资料；</p><p><br></p><p><br></p><p><br></p><p>3.2 您会遵守本隐私政策的全部条款和限制；</p><p><br></p><p><br></p><p><br></p><p>3.3 您同意我们通过您登陆本网站、在本网站上注册和/或使用我们提供的服务收集您的信息；您同意日后我们对隐私政策的任何修改；</p><p><br></p><p><br></p><p><br></p><p>3.4 您同意我们的分公司、附属公司、雇员就您可能会感兴趣的产品和服务与您联络( 除非您已经表示不想收到该等讯息 )。</p><p><br></p><p><br></p><p><br></p><p>&nbsp;</p><p><br></p><p><br></p><p><br></p><p>四、收集的信息</p><p><br></p><p><br></p><p><br></p><p>4.1 当您使用本网站时，您同意我们开始使用cookies来追踪您的每一个动作，并收集和记住您留下的所有信息，其中包括但不限于您的IP地址，地理位置及其他资料。</p><p><br></p><p><br></p><p><br></p><p>4.2 如果您愿意使用本网站提供的服务，您需要填写和提供以下两种信息：</p><p><br></p><p><br></p><p><br></p><p>4.2.1 身份信息。该信息可以帮助我们验证您是否有资格注册为本网站会员，包括但不限于您的名字、您的居住地址、邮寄地址、您所属国家或政府签发的其他具有证明您身份信息的不同的证书以及涉及到的号码及所有其他可帮助我们验证您身份的信息（以下合称为“身份信息” ）。</p><p><br></p><p><br></p><p><br></p><p>4.2.2 服务信息。该信息帮助我们与您联系并顺利为您提供服务，包括但不限于您的电话号码、传真号码、有效的电子邮件地址、邮寄地址以及您的借记卡信息和/或其他帐户信息（以下合 称为“服务信息” ）。</p><p><br></p><p><br></p><p><br></p><p>4.3 在您使用本网站或其提供的服务时，我们可能会为了改进本网站的使用功能，提升您对使用本网站及其提供的服务及其安全性的体验或是根据法院或可适用法律法规或有管辖权的其他政府机构的命令，通过本网站公示的专属于我们的邮箱或其他我们认为合规的方式收集更多的必要的信息。</p><p><br></p><p><br></p><p><br></p><p>4.4 如果您访问了在本网站上的其他第三方网站或合作的第三方的任何链接，您应同意并遵守该第三方网单独和独立的隐私政策。我们对这些网站或合作方的内容及活动不承担任何责任。</p><p><br></p><p><br></p><p><br></p><p>&nbsp;</p><p><br></p><p><br></p><p><br></p><p>五、Cookies</p><p><br></p><p><br></p><p><br></p><p>5.1 当您到访我们网站时, 我们通过cookies使用Google Stats去记录我们的业绩以及核对在线广告的效果。Cookie是发送到您的浏览器上并在您的电脑硬盘驱动器上存储的小量数据。只有当您使用您的电脑进入我们网站时,Cookie才能够被发送到您的电脑硬盘上。</p><p><br></p><p><br></p><p><br></p><p>5.2 Cookies常用于记录访问者浏览我们网站上的各个项目时的习惯以及偏好。Cookies所搜集的资料是不记名的集体统计数据, 不载有个人资料。</p><p><br></p><p><br></p><p><br></p><p>5.3 Cookies不能用于取得您的硬盘上的数据、您的电邮地址、及您的私人数据，其可使本网站或服务商系统识别到您的浏览器并捕捉和记忆信息。大多数浏览器都预设为可以接受Cookies。您可以选择将您的浏览器设定为不接受Cookies,或如果Cookies一被装上就通知您。不过, 若设定为禁止Cookies, 您或许便不能启动或使用我们网站的某些功能。</p><p><br></p><p><br></p><p><br></p><p>&nbsp;</p><p><br></p><p><br></p><p><br></p><p>六、信息使用用途</p><p><br></p><p><br></p><p><br></p><p>6.1 我们为了以下目的或以下列方式使用我们收集到的您的信息：</p><p><br></p><p><br></p><p><br></p><p>6.1.1 通过我们的网站向您提供我们的各项服务；</p><p><br></p><p><br></p><p><br></p><p>6.1.2 当您使用我们的网站时, 能辨认及确认您的身份；</p><p><br></p><p><br></p><p><br></p><p>6.1.3 为了改善和提高网站的服务（根据我们收到的您的信息及反馈，帮助我们改善网站的服务，进而我们可以更有效地对您的服务请求和支持需求做出回应）；</p><p><br></p><p><br></p><p><br></p><p>6.1.4 统计我们网站使用量的数据和政府机关、事业单位等合作的数据分析；</p><p><br></p><p><br></p><p><br></p><p>6.1.5 个性化您的体验（您的信息将帮助我们更好地为您的个性化需求作出回应）；</p><p><br></p><p><br></p><p><br></p><p>6.1.6 处理交易（您的信息，无论是公共或私人的，未经您的同意不会以任何理由被出售、交换、转移，或提供给任何其他公司，但除了为完成您所要求的交易的明确目的之外 ）；</p><p><br></p><p><br></p><p><br></p><p>6.1.7 定期发送电子邮件（您提供订单处理的电子邮件地址，除了偶尔接收我们的新闻，更新，相关产品或服务的信息等，可用来向您发送信息和更新有关您的订单）；</p><p><br></p><p><br></p><p><br></p><p>6.1.8 满足本网站用户协议规定的其他目的和为了满足该等目的的所有合法途径。</p><p><br></p><p><br></p><p><br></p><p>6.2 我们不会向其他方出售、交易或以其他方式转让信息或允许他人收集、使用信息，但不包括以下其他方和以下信息：我们的关联方、帮助我们经营我们的网站、开展业务、或者向您提供服务的受信任的第三方，只要这些当事方同意将这些信息保密；当我们相信披露的信息是适当的，是遵守法律、法规、规章制度的或来自于法院或他主管当局的命令、执行我们的网站策略，正常运行网站所需要，关联方提供服务所需或保护我们或他人的权利、财产或安全的。但是，您的信息不会提供给其他方进行营销，广告或其他用途。</p><p><br></p><p><br></p><p><br></p><p>&nbsp;</p><p><br></p><p><br></p><p><br></p><p>七、个人资料的保护</p><p><br></p><p><br></p><p><br></p><p>7.1 我们实施妥善的实物、电子、管理及技术方面的措施来保护和保障您的个人资料的安全。我们尽力确保通过我们网站所搜集的任何个人资料皆免于任何与我们无关的第三者的滋扰。我们采取的安全措施包括但不限于：</p><p><br></p><p><br></p><p><br></p><p>7.1.1 实物措施：存有您个人资料的记录会被存放在有锁的地方。</p><p><br></p><p><br></p><p><br></p><p>7.1.2 电子措施：存有您个人资料的电脑数据会被存放在受严格登入限制的电脑系统和存储媒体上。</p><p><br></p><p><br></p><p><br></p><p>7.1.3 管理措施：只有经我们授权的职员才能接触到您的个人资料, 这些职员需要遵守我们个人资料保密的内部守则。</p><p><br></p><p><br></p><p><br></p><p>7.1.4 技术措施：可能采用如Secure Socket Layer Encryption这种加密技术来输送您的个人资料。</p><p><br></p><p><br></p><p><br></p><p>7.1.5 其它措施：我们的网络服务器受到“防火墙”的保护。</p><p><br></p><p><br></p><p><br></p><p>7.2 若您知悉我们的网站上有任何安全方面的漏洞, 请马上联系我们, 使我们可以尽快采取妥适的行动。</p><p><br></p><p><br></p><p><br></p><p>7.3 尽管实施了上述技术和保安的措施, 我们不能保证资料在互联网上的输送绝对安全, 因此我们不能绝对保证您通过我们网站提供给我们的个人资料在一切时候都是安全的。对任何因未经授权而接触您个人资料所发生的事件我们一槪不承担责任, 于这方面产生或导致的任何损失或损害, 我们不负责赔偿。</p><p><br></p><p><br></p><p><br></p><p>&nbsp;</p><p><br></p><p><br></p><p><br></p><p>八、隐私政策的修订</p><p><br></p><p><br></p><p><br></p><p>我们保留随时修改该隐私政策的权利。我们通过更新和发布新版本的生效日期告诉您我们修订了隐私政策，并突出修订处，有时我们会发布通知告诉您隐私政策已修订，但这不是我们的一项义务。您应定期查看隐私政策并关注其修订情况，如果您不同意修订的内容，您应停止立即访问本网站。当隐私政策的更新版本发布，您持续访问本网站显示和表明您同意该更新的内容，并同意遵守该更新的隐私权政策。</p><p><br></p><p><br></p><p><br></p><p>&nbsp;</p><p><br></p><p><br></p><p><br></p><p>九、与我们的沟通</p><p><br></p><p><br></p><p><br></p><p>9.1 如果您有任何要求和意见，您可以通过电子邮件contact@QIBIT.io，这是属于我们与您沟通的唯一有效和官方电子邮件，所以我们对您未使用有效的联系方式，任何作为或不作为不承担责任。</p><p><br></p><p><br></p><p><br></p><p>9.2 我们只通过本网站上的有效的联系方式发布公告和信息或在本网站张贴公告，所以我们对由于您信任了未通过以上方式获得的信息而产生的任何损失不承担责任。</p><p><br></p><p><br></p><p><br></p><p>9.3 若您对我们的隐私政策有任何问题, 欢迎随时联系我们。</p><p><br></p>','2020-09-19 07:07:52','',NULL,10,0,5,'隐私条款','CN'),(9,'admin','<p>项目申请</p><p><br></p><p>项目通过QIBIT官网提交项目白皮书、官网（或发送文件到指定邮箱：listing@QIBIT.io）、Token信息等相关资料，官方上币团队审核材料的真实性、完整性、合约安全性等。</p><p><br></p><p><br></p><p><br></p><p>&nbsp;</p><p><br></p><p>上线交易</p><p><br></p><p>首先开通BTC和ETH交易对， BTC和ETH交易对中每周流动性排名第一且未上线USDT交易对的项目可直接上线USDT交易对； 关于对流动性排名的计算方法：每周计算BTC和ETH区交易对的交易人数排名、交易额排名，同时要有正常的盘面深度，交易人数和交易额权重分别是70%、30%，加权后排名第一的项目即是流动性第一的项目； 关于开通USDT的业务要求：业务进展顺利，社群积极维护</p><p><br></p><p><br></p><p><br></p><p>退市处理情形</p><p><br></p><p>上币项目出现下列情形之一的，我们会给予退市处理：</p><p><br></p><p><br></p><p><br></p><p>1) 项目方故意隐瞒可能严重影响代币价格的重大事件；</p><p><br></p><p>2) 项目涉嫌洗钱、欺诈或传销等违法犯罪活动的；</p><p><br></p><p>3) 项目存在其他重大风险隐患如黑客盗币、隐瞒增发等，足以使项目发生风险事件的。</p><p><br></p><p>4) 代币日平均交易额低于2万美金或其他等值代币，持续达15日以上;</p><p><br></p><p>5) 项目方涉嫌操纵市场，情节严重的；</p><p><br></p><p>6) 项目方宣传或市场行为损害BikiCoin或社区利益，情节严重的；</p><p><br></p><p>7) 项目方团队解散或发生成员异动；</p><p><br></p><p>8) 其他足以退市的情形。</p><p><br></p>','2020-09-19 07:09:37','',NULL,2,0,5,'商务对接','CN'),(10,'admin','<p>什么是KDJ指标？</p><p><br></p><p>KDJ全名为随机指标（Stochastics），由George Lane所创，其综合动量观念，强弱指标及移动平均线的优点，早年应用在期货投资方面，功能颇为显著，目前为股市中最常用的指标之一。</p><p><br></p><p><br></p><p><br></p><p>　　买卖原则：</p><p><br></p><p><br></p><p><br></p><p>　　1. K值由右边向下交叉D值作卖，K值由右边向上交叉D值作买。</p><p><br></p><p>　　2. 高档连续两次向下交叉确认跌势。低档两次向上交叉确认涨势。</p><p><br></p><p>　　3. D值《20%超卖，D值》80%超买；J》100%超买，J《10%超卖。</p><p><br></p><p>　　4. KD值于50%左右徘徊或交叉时，无意义。</p><p><br></p><p>　　5. 投机性太强的个股不适用。</p><p><br></p><p>　　6. 可观察KD值与股价之背离，以确认高低点。</p><p><br></p><p><br></p><p><br></p><p>　　KDJ指标</p><p><br></p><p><br></p><p><br></p><p>　　KDJ指标的中文名称是随机指数（Stochastics），是由George Lane首创的。</p><p><br></p><p><br></p><p><br></p><p>　　1．KDJ指标的计算公式和理论上的依据</p><p><br></p><p><br></p><p><br></p><p>　　产生KD以前，先产生未成熟随机值RSV（Row Stochastic value）。其计算公式为</p><p><br></p><p><br></p><p><br></p><p>　　式中，l／3为平滑因子，可以改成别的数字，同样已成约定，1／3也已经固定。</p><p><br></p><p><br></p><p><br></p><p>　　KD是在WMS的基础上发展起来的，所以KD就有WMS的一些特性。在反映证券市场价格变化时，WMS最快，K其次，D最慢。在使用KD指标时，我们往往称K指标为快指标，D指标为慢指标。K指标反应敏捷，但容易出错；D指标反应稍慢，但稳重可靠。</p><p><br></p><p><br></p><p><br></p><p>　　在介绍KD时，往往还附带一个J指标，计算公式为</p><p><br></p><p><br></p><p><br></p><p>　　J＝3D一2K＝D十2（D―K）</p><p><br></p><p><br></p><p><br></p><p>　　可见J是D加上一个修正值。J的实质是反映D和D与K的差值。此外，有的书中J指标的计算公式为</p><p><br></p><p><br></p><p><br></p><p>　　J＝3K一2D</p><p><br></p><p><br></p><p><br></p><p>　　2．KDJ指标的应用法则</p><p><br></p><p><br></p><p><br></p><p>　　KDJ指标是三条曲线，在应用时主要从五个方面进行考虑：KD取值的绝对数字；KD曲线的形态；KD指标的交叉；KD指标的背离；J指标的取值大小。</p><p><br></p><p><br></p><p><br></p><p>　　第一，从KD的取值方面考虑。KD的取值范围都是0―l00，将其划分为几个区域：超买区、超卖区、徘徊区。按一般的划分法，80以上为超买区，20以下为超卖区，其余为徘徊区。</p><p><br></p><p><br></p><p><br></p><p>　　根据这种划分，KD超过80就应该考虑卖出，低于20就应该考虑买入。这种操作是很简单的，同时又是很容易出错的，完全按这种方法进行操作很容易招致损失。大多数对KD指标了解不深入的人，以为KD指标的操作就限于此，故而对KD指标的作用产生误解。应该说明的是，上述对0一100的划分只是一个应用KD指标的初步过程，仅仅是信号。</p><p><br></p><p><br></p><p><br></p><p>　　第二，从KD指标曲线的形态方面考虑。当KD指标在较高或较低的位置形成了头肩形和多重顶（底）时，是采取行动的信号。注意，这些形态一定要在较高位置或较低位置出现，位置越高或越低，结论越可靠，越正确。操作时可按形态学方面的原则进行。</p><p><br></p><p><br></p><p><br></p><p>　　对于KD的曲线我们也可以画趋势线，以明确KD的趋势。在KD的曲线图中仍然可以引进支撑线和压力线的概念。某一条支撑线或压力线的被突破，也是采取行动的信号。</p><p><br></p><p><br></p><p><br></p><p>　　第三，从KD指标的交叉方面考虑。K与D的关系就如同股价与MA的关系一样，也有死亡交叉和黄金交叉的问题，不过这里交叉的应用是很复杂的，还附带很多其他条件。</p><p><br></p><p>下面以K从下向上与D交叉为例进行介绍。</p><p><br></p><p><br></p><p><br></p><p>　　K上穿D是金叉，为买入信号，这是正确的。但是出现了金叉是否应该买入，还要看别的条件：</p><p><br></p><p><br></p><p><br></p><p>　　第一个条件是金叉的位置应该比较低，是在超卖区的位置，越低越好。</p><p><br></p><p>　　第二个条件是与D相交的次数。有时在低位，K、D要来回交叉好几次。交叉的次数以2次为最少，越多越好。</p><p><br></p><p>　　第三个条件是交叉点相对于KD线低点的位置，这就是常说的“右侧相交”原则。K是在D已经抬头向上时才同D相交，比D还在下降时与之相交要可靠得多。换句话说，右侧相交比左侧相交好。</p><p><br></p><p><br></p><p><br></p><p>　　满足了上述条件，买入就放心一些。少满足一条，买入的风险就多一些。但是，如果要求每个条件都满足，尽管比较安全，但也会错过很多机会。</p><p><br></p><p><br></p><p><br></p><p>　　对于K从上向下穿破D的死叉，也有类似的结果，读者不妨自己试试，这里就不重复了。</p><p><br></p><p><br></p><p><br></p><p>　　第四，从KD指标的背离方面考虑。简单地说，背离就是走势的不一致。在KD处在高位或低位，如果出现与股价走向的背离，则是采取行动的信号。当KD处在高位，并形成两个依次向下的峰，而此时股价还在一个劲地上涨，这叫顶背离，是卖出的信号；与之相反，KD处在低位，并形成一底比一底高，而股价还继续下跌，这构成底背离，是买入信号。</p><p><br></p><p><br></p><p><br></p><p>　　第五，J指标取值超过100和低于0，都属于价格的非正常区域，大于100为超买，小于O为超卖。</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p>KDJ指标的实战经验应用</p><p><br></p><p><br></p><p><br></p><p>　　1） 在实际操作中，一些做短平快的短线客常用分钟指标，来判断后市决定买卖时机，在T+0时代常用15分钟和30分钟KDJ指标，在T+0时代多用30分钟和60分钟KDJ来指导进出，几条经验规律总结如下：</p><p><br></p><p>A） 如果30分钟KDJ在20以下盘整较长时间，60分钟KDJ也是如此，则一旦30分钟K值上穿D值并越过20，可能引发一轮持续在2天以上的反弹行情；若日线KDJ指标也在低位发生金叉，则可能是一轮中级行情。但需注意K值与D值金叉后只有K值大于D值20％以上，这种交叉才有效；</p><p>B） 如果30分钟KDJ在80以上向下掉头，K值下穿D值并跌破80，而60分钟KDJ才刚刚越过20不到50，则说明行情会出现回档，30分钟KDJ探底后，可能继续向上；</p><p>C） 如果30分钟和60分钟KDJ在80以上，盘整较长时间后K值同时向下死叉D值，则表明要开始至少2天的下跌调整行情；</p><p>D） 如果30分钟KDJ跌至20以下掉头向上，而60分钟KDJ还在50以上，则要观察60分钟K值是否会有效穿过D值（K值大于D值20％），若有效表明将开始一轮新的上攻；若无效则表明仅是下跌过程中的反弹，反弹过后仍要继续下跌；</p><p>E） 如果30分钟KDJ在50之前止跌，而60分钟KDJ才刚刚向上交叉，说明行情可能会再持续向上，目前仅属于回档；</p><p>F） 30分钟或60分钟KDJ出现背离现象，也可作为研判大市顶底的依据，详见前面日线背离的论述；</p><p>G） 在超强市场中，30分钟KDJ可以达到90以上，而且在高位屡次发生无效交叉，此时重点看60分钟KDJ，当60分钟KDJ出现向下交叉时，可能引发短线较深的回档；</p><p>H） 在暴跌过程中30分钟KDJ可以接近0值，而大势依然跌势不止，此时也应看60分钟KDJ，当60分钟KDJ向上发生有效交叉时，会引发极强的反弹。</p><p><br></p><p><br></p><p>　　2） 当行情处在极强极弱单边市场中，日KDJ出现屡屡钝化，应改用MACD等中长指标；当股价短期波动剧烈，日KDJ反应滞后，应改用CCI，ROC等指标；或是使用SLOWKD慢速指标；3） KDJ在周线中参数一般用5，周KDJ指标见底和见顶有明显的提示作用，据此波段操作可以免去许多辛劳，争取利润最大化，需提示的是一般周J值在超卖区V形单底上升，说明只是反弹行情，形成双底才为可靠的中级行情；但J值在超买区单顶也会有大幅下跌的可能性，所以应该提高警惕，此时应结合其他指标综合研判；但当股市处在牛市时，J值在超买区盘中一段时间后，股价仍会大幅上升。</p><p><br></p><p><br></p><p><br></p><p>KDJ指标钝化的应对技巧</p><p><br></p><p>　　KDJ指标是投资者研判行情时经常使用的一种技术指标，它的优点是对价格的未来走向变动比较敏感，一般来说，黄金交叉意味着买进，死亡交叉意味着抛空。</p><p><br></p><p><br></p><p><br></p><p>　　但是，任何指标都不是万能的。从另一方面来讲，KDJ指标的反应敏感又是它不足的地方，黄金交叉的信号经常可能使投资者进货太早而被套牢，死亡交叉信号也可能使投资者出货太早而被轧空，KDJ指标失灵的情况往往出现在极强的市场或极弱的市场中，此时KDJ必然会发生高位钝化和低位钝化的情况，如果这时候还按照黄金交叉进货，死亡交叉出货进行操作，就会在行情刚启动时，丢掉一个主升段行情；行情刚开始下跌，KDJ就发出黄金交叉，进货可能被套牢，而且价位损失将非常大，因为KDJ指标可以在钝化再钝化。</p><p><br></p><p><br></p><p><br></p><p>　　当KDJ指标发生钝化的时候，可以用如下方法来识别：</p><p><br></p><p>一、由于KDJ指标的敏感，它给出的指标经常超前，因此可以通过观察KDJ指标的形态来帮助寻找正确的买点和卖点，KDJ指标在低位形成W底、三重底和头肩底形态时再进货；在较强的市场里，KDJ指标在高位形成M头和头肩顶时，出货的信号更可靠。投资者尤其应该注意KDJ与RSI一样，经过振荡后形成的反压线准确性较高。</p><p><br></p><p><br></p><p><br></p><p>二、KDJ指标和数浪相结合，是一种非常有效的方法。在K线图上，经常可以清晰地分辨出上升形态的一浪、三浪、五浪。在K线图上，期价盘底结束，开始上升，往往在上升第一子浪时，KDJ指标即发出死亡交叉的出货信号，这时候，可以少考虑这个卖出信号，因为它很可能是一个错误信号或是一个骗线信号。当期价运行到第三浪时，加大对抛空信号的重视程度，当期价运动到明显的第五子浪时，如果KDJ指标给出卖出信号，则应坚决出货。这时候信号通常都是非常准确的，当期价刚刚结束上升开始下跌时，在下跌的第一子浪，应少考虑KDJ指标的买进信号，当期价下跌到第三子浪或第五子浪时，再考虑KDJ指标的买入信号，尤其是下跌五子浪后的KDJ给出的买进信号较准确。</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p>KDJ指标实用技巧</p><p><br></p><p><br></p><p><br></p><p>　　在知晓KDJ指标的基本原理及其一般应用法则的基础上，还应对其实用技巧作一定了解，并在实际操作中逐步巩固、完善。</p><p><br></p><p><br></p><p><br></p><p>　　一、KDJ指标的局限性</p><p><br></p><p><br></p><p><br></p><p>　　对KDJ指标的分析、运用必须附属于基本的趋势分析，从这个意义上说，KDJ指标只是一种第二位的指标。市场的主要趋势是压倒一切的，在一场重要运动即将降临时，KDJ指标可能丧失功能，甚至产生误导，以青山纸业（2.37，0.01，0.42%）（2.37，0.01，0.42%）（600103）为例，其KDJ指标在7月5日与5月31日超买区形成双顶，并开始掉头向下，甚至在7月7日KDJ指标超买区一度发生死叉，发出强烈卖出信号，但当时基本趋势是底部放量，向上突破10.2元重要阻力位，如果此时仅凭KDJ指标的卖出信号作出决策，则将错失整个主升浪。</p><p><br></p><p><br></p><p><br></p><p>　　二、KDJ指标何时最有效</p><p><br></p><p><br></p><p><br></p><p>　　当市场进入无趋势阶段（横向延伸状态）时，大多数跟随趋势系统都不能正常工作，而KDJ指标却能提供较好的帮助。依据KDJ指标发出的买入、卖出信号，可以帮助短线投资者在无趋势市场环境中获得短差，如中兴通讯（13.59，0.11，0.82%）（13.59，0.11，0.82%）（0063），5.19行情之后，相当部分时间处于横盘状态，依据KDJ指标发出的信号，可以几次短线获利。</p><p><br></p><p><br></p><p><br></p><p>　　在趋势阶段，把KDJ指标与价格图表参照使用，当市场即将出现短暂的极端状态时，KDJ指标能提醒投资者。同时，当趋势渐趋成熟，KDJ指标可以在价格明显显露之前，给投资者提供预警信号。</p><p><br></p><p><br></p><p><br></p><p>　　三、与K线形态等综合使用</p><p><br></p><p><br></p><p><br></p><p>　　我们知道，K线形态中，有一些可以预警趋势的反转，如流星、黄昏星、高位十字星与空头吞噬等有上升趋势反转的预警作用；而多头吞噬、启明星、锤子线等则有下降趋势反转的预警作用。如果把KDJ指标与这些K线形态综合使用，相互印证，则可提高决策的准确性。</p><p><br></p><p><br></p><p><br></p><p>　　如大亚股份（0910）8月28日K线形态为流星，KDJ指标高位形成双顶，均预示着股价的回跌。</p><p><br></p><p><br></p><p><br></p><p>　　同样，把KDJ指标与重要阻力、支持位，成交量变化等综合使用，也可提高KDJ指标使用的准确性。再以大亚股份为例，8月28日股价最高上摸15.2元，临近15.3元重要阻力位，且上攻时成交量未能有效放大（与8月24日相比），也印证了KDJ指标发出的卖出信号。</p><p><br></p><p><br></p><p><br></p><p>　　四、周线KDJ指标更为有效</p><p><br></p><p><br></p><p><br></p><p>　　由于周线指标作为中期指标，不容易制造“骗线”，因而在应用KDJ指标时，周线往往效果更佳，当周线KDJ指标两次或两次以上发出金叉（死叉）时，往往能预示MACD等跟随趋势指标发生金叉（死叉），从而提前预示重要趋势的降临，这对中长线投资者无疑极具意义。</p>','2020-09-19 07:11:52','',NULL,1,0,4,'KDJ指标基础','CN'),(11,'admin','<p>什么是MACD指标？</p><p><br></p><p><br></p><p><br></p><p>MACD基本介绍MACD的全名为 Moving Average Convergence/Pergence，它是一种移动平均线的波动指标，不过它使用的不是普通移动平均线，而是将长期与中期的平滑移动平均线 (EMA)的累积差距计算出来。 在MACD图形中显示两条图线，一条是实线就是MACD线，而另一条线为虚线 (Trigger line)就是MACD的移动平均线。在MACD线与Trigger线之间的差距可以画成柱状垂直线图 (Oscillators)，且以零 (0)为中心轴，以柱状垂直线图 (Oscillators) 图的正负表示MACD线与Trigger线何者在上，何者在下以作为研判买卖的最佳时机。</p><p><br></p><p><br></p><p><br></p><p>MACD的计算公式</p><p><br></p><p><br></p><p><br></p><p>MACD在应用上应先行计算出快速（一般选12日）移动平均数值与慢速（一般选26日）移动平均数值。以这两个数值作为测量两者（快速与慢速线）间的\"差离值\"依据。所谓\"差离值\"（DIF），即12日EMA数值减去26日EMA数值。因此，在持续的涨势中，12日EMA在26日EMA之上。其间的正差离值（+DIF）会愈来愈大。反之在跌势中，差离值可能变负（-DIF），也愈来愈大。</p><p><br></p><p><br></p><p><br></p><p>至于行情开始回转，正或负差离值要缩小到怎样的程度，才真正是行情反转的信号。MACD的反转信号界定为\"差离值\"的9日移动平均值（9日EMA）。</p><p><br></p><p><br></p><p><br></p><p>在MACD的指数平滑移动平均线计算公式中，都分别加重最近一日的份量权值，以现在流行的参数12和26为例，其公式如下：</p><p><br></p><p><br></p><p><br></p><p>12日EMA的计算：EMA12 = 前一日EMA12 X 11/13 + 今日收盘 X 2/13</p><p><br></p><p><br></p><p><br></p><p>26日EMA的计算：EMA26 = 前一日EMA26 X 25/27 + 今日收盘 X 2/27</p><p><br></p><p><br></p><p><br></p><p>差离值（DIF）的计算： DIF = EMA12 - EMA26</p><p><br></p><p><br></p><p><br></p><p>然后再根据差离值计算其9日的EMA，即\"差离平均值\"，\"差离平均值\"用DEA来表示。</p><p><br></p><p><br></p><p><br></p><p>DEA = （前一日DEA X 8/10 + 今日DIF X 2/10）</p><p><br></p><p><br></p><p><br></p><p>计算出的DIF与DEA为正或负值，因而形成在0轴上下移动的两条快速与慢速线。为了方便判断，用DIF减去DEA，用以绘制柱状图。</p><p><br></p><p><br></p><p><br></p><p>MACD的作用</p><p><br></p><p><br></p><p><br></p><p>就其优点而言，MACD可自动定义出目前股价趋势之偏多或偏空，避免逆向操作的危险。而在趋势确定之后，则可确立进出策略，避免无谓之进出次数，或者发生进出时机不当之后果。MACD虽然适于研判中期走势，但不适于短线操作。再者，MACD可以用来研判中期上涨或下跌行情的开始与结束，但对箱形的大幅振荡走势或胶著不动的盘面并无价值。同理，MACD用于分析各股的走势时，较适用于狂跌的投机股，对于价格甚少变动的所谓牛皮股则不适用。总而言之，MACD的作用是找出市场的超买超卖点，从市场的转势点。</p><p><br></p><p><br></p><p><br></p><p>MACD金叉与死叉</p><p><br></p><p><br></p><p><br></p><p>MACD白线从下往上穿过黄线，这种叫金叉，一般在低位由跌转涨的时候，一般作为买入机会。</p><p><br></p><p><br></p><p><br></p><p>MACD白线从上而下穿过黄线，这种叉叫死叉，一般在高位由涨转跌的时候，一般作为卖出操作。</p><p><br></p><p><br></p><p><br></p><p>MACD金叉是典型的买入信号，但是MACD金叉的出现时常也是情况各异，比如有0轴上方MACD金叉、0轴下方MACD金叉等，这些表示的市场含义都是不一样的，0轴上MACD金叉一般是上升行情的开始或者是延续之前的上升行情，而0轴下MACD金叉的实质一般是下跌行情后的第一波反弹，因此对于不同的MACD金叉情况，我们需要有不同的辅助指标来区分配合，同时还要细心分辨和处理。同样利用死叉卖出也是一样，需要区分对待。</p><p><br></p><p><br></p><p><br></p><p>MACD指标最有效常用的逃顶方法：</p><p><br></p><p><br></p><p><br></p><p>在实际投资中，MACD是指标不但具备抄底（背离是底）、捕捉极强势上涨点（MACD连续二次翻红买入）、捕捉“洗盘结束点”（上下背离买入）的功能，使你尽享-买后就涨的乐趣，同时，它还具备使你捕捉到最佳卖点，帮你成功逃顶，使你尽享丰收后的感觉。</p><p><br></p><p><br></p><p><br></p><p>MACD捕捉最佳卖（做空）点的方法如下：</p><p><br></p><p><br></p><p><br></p><p>调整MACD的有关参数——MACD参数设定为：8、13、9；移动平均线参数分别为5、10、30。设定好参数后，便是寻找卖点。</p><p><br></p><p><br></p><p><br></p><p>由于一个股票的卖点有许多，这里介绍两种最有效、最常用的逃顶方法：</p><p><br></p><p><br></p><p><br></p><p>第一卖点或称相对顶——其含义是指股价在经过大幅拉升后出现横盘，从而形成的一个相对高点，投资者尤其是资金量较大的投资者，必须在第一卖点出货，或减仓。判断“第一卖点”成立的技巧-是“股价横盘、MACD死叉卖出”，也就是说，当股价经过连续的上涨出现横盘时，5日、10日移动平均线尚未形成死叉，但MACD率先死叉，死叉之日便是“第一-卖点”形成之时，应该卖出或减仓。</p><p><br></p><p><br></p><p><br></p><p>MACD指标使用技巧</p><p><br></p><p><br></p><p><br></p><p>MACD买入技巧</p><p><br></p><p><br></p><p><br></p><p>1、一只股票的强弱程度，从周K线中完全可以获知。特别要关注周K线中半年均线的走势，如果上市时间较短，半年均线还没有生成，就要关注60天均线的走势，也可以获得同样的效果。</p><p><br></p><p><br></p><p><br></p><p>一只股票在周K线上出现半年均线，要2年零4个月的时间，出现60天均线需要1年零2个月的时间。如果让半年均线走平，上市时间要4年半，让60天均线走平要3年半。在这么长的时间里，如果股价的走势能使半年均线或60天均线走平，且股价在它上面站稳，充分说明其中隐藏着大庄家或者是大机构。当股价上上下下走过几个来回后，里面的中小散户已经被吓得魂飞魄散，震的死去活来，大多数筹码已经进了大机构的口袋。这时大机构只要用少量的筹码，就可以轻松的把股价打上去。在半年均线走平半年到一年的时间内，大机构如果仍不拉升该股，可能有三个原因：一是大盘形势不好，拉升时间未到；二是庄家手头资金还不宽裕，需要调集资金；三是庄家与上市公司的谈判还未取得实际成果。</p><p><br></p><p><br></p><p><br></p><p>2、周K线中的半年均线或60天均线呈10或15度角微上翘的股票。有了这条经验，大机构再洗盘，你就不回被洗掉。</p><p><br></p><p><br></p><p><br></p><p>3、散户进入的时机最好是“三金叉见底”首次拉升后回调之时，当周K线MACD在0轴上方金叉，成交量均线形成金叉，周K线中5天均线与10天均线金叉后，散户朋友可以大胆买入，不涨一倍不卖出。</p><p><br></p><p><br></p><p><br></p><p>MACD卖出技巧</p><p><br></p><p><br></p><p><br></p><p>第一卖点。股价在经过大幅拉升后出现横盘，从而形成的一个相对高点，投资者尤其是资金量较大的投资者，必须在第一卖点出货，或减仓。判断“第一卖点”成立的技巧是“股价横盘、MACD死叉卖出”，也就是说，当股价经过连续的上涨出现横盘时，5日、10日移动平均线尚未形成死叉，但MACD率先死叉，死叉之日便是“第一卖点”形成之时，应该卖出或减仓。</p><p><br></p><p><br></p><p><br></p><p>当第一卖点形成之后，会有一些股票没有出现大跌，反而回调之后为掩护出货假装向上突破的现象，多头主力做出货前的最后一次拉升，又称虚浪拉升，此时形成的高点往往是成为一波牛市行情的最高点，所以又称绝对顶，如果此时不能顺利出逃的话，后果不堪设想。</p><p><br></p><p><br></p><p><br></p><p>判断绝对顶成立技巧是“价格、MACD背离卖出”，即当股价进行虚浪拉升创出新高时，MACD却不能同步创出新高，二者的走势产生背离，这是股价见顶的明显信号。必然说明的是在绝对顶卖股票时，决不能等MACD死叉后再卖，因为当MACD死叉时股价已经下跌了许多，在虚浪顶卖股票必须参考K线组合。</p><p><br></p><p><br></p><p><br></p><p>一般来说，在虚浪急拉过程中如果出现“高开低走阴线”或“长下影线涨停阳线”时，是卖出的极佳时机。最后需要提醒的是，由于MACD指标具有滞后性，用MACD寻找最佳卖点逃顶特别适合那些大幅拉升后做平台头的股票，不适合那些急拉急跌的股票。上面的两点都是在股票大幅度上涨之后才会出现的，换句话说，它出现在股票主升浪之后，如果一只股票尚未大幅上涨，不定期没有进行过主升浪，那么，不要使用上面的方法。</p><p><br></p><p><br></p><p><br></p><p>逃顶的办法很多，具体股民适用哪个都是不确定的，所以要找到适合自己的方法。只有适合自己的才是最好的。</p>','2020-09-19 07:12:16','',NULL,2,0,4,'MACD指标基础','CN'),(12,'admin','<p style=\"padding-top: 0px; padding-bottom: 0px;\"><i><font size=\"2\" color=\"#949494\">前言：现在比特币市值已经超过1000多亿美元，但是外界仍然对这种数字货币争论不休。有人认为包括比特币在内的数字货币是庞氏骗局。它是不是庞氏骗局呢？不同的人对这个问题有不同的看法。本文来自decentralize.today，作者Miguel Cuneta通过分析认为比特币和庞氏骗局是完全不同的东西，原文由蓝狐笔记社群“iGreenMind”负责翻译。</font></i></p><p style=\"padding-top: 0px; padding-bottom: 0px;\"><br></p><p style=\"padding-top: 0px; padding-bottom: 0px;\"><span style=\"font-weight: bolder;\">什么是“庞氏骗局”?</span></p><p style=\"padding-top: 0px; padding-bottom: 0px;\"><br></p><p style=\"padding-top: 0px; padding-bottom: 0px;\">Investopedia上是这么解释的：</p><p style=\"padding-top: 0px; padding-bottom: 0px;\"><br></p><p style=\"padding-top: 0px; padding-bottom: 0px;\"><i><font size=\"2\" color=\"#949494\">“庞氏骗局是一种欺骗性的投资骗局，承诺高回报率、对投资者来说风险很小。庞氏骗局通过吸纳新投资者来为老投资者带来回报。这类似于一个金字塔骗局，两者都是使用新投资者的资金来支付早期的支持者。对于庞氏骗局和金字塔骗局，最终没有足够的资金来解决这些问题。”</font></i></p><p style=\"padding-top: 0px; padding-bottom: 0px;\"><br></p><div class=\"image-desc\" style=\"text-align: center; color: rgb(51, 51, 51);\"><img class=\"uploaded-img\" src=\"https://bizzan.oss-cn-hangzhou.aliyuncs.com/2019/07/11/3894ee85-7c4d-41a7-aad7-ba2c5a18c427.png\" max-width=\"100%\" width=\"auto\" height=\"auto\" style=\"border-style: none; width: 1713px;\"></div><div class=\"image-desc\"><p style=\"padding-top: 0px; padding-bottom: 0px;\"><br></p><p style=\"padding-top: 0px; padding-bottom: 0px;\">&nbsp; &nbsp; &nbsp; 想让全世界知道你对比特币技术完全无知，最好的方法有：一是使用郁金香泡沫作比喻，二是说比特币是一种庞氏骗局。一个人喜欢这么说，大多是因为在对一件自己不了解的事物做出断言前，根本没有能力去做一些基础研究。</p><p style=\"padding-top: 0px; padding-bottom: 0px;\"><br></p><p style=\"padding-top: 0px; padding-bottom: 0px;\">&nbsp; &nbsp; &nbsp; 当你了解比特币背后的技术和它被发明的原因，或许就会发现<span style=\"font-weight: bolder;\">比特币完全不是旁氏骗局</span>。好了，让我们抽丝剥茧地来做一个分解。有人说，庞氏骗局是一种欺骗性的投资骗局，承诺高回报率，对投资者来说风险很小。</p><p style=\"padding-top: 0px; padding-bottom: 0px;\"><br></p><p style=\"padding-top: 0px; padding-bottom: 0px;\">&nbsp; &nbsp; &nbsp; 中本聪最初发布的比特币白皮书，大概有八页那么长，相当有技术性，但消化起来也不是特别困难。其中没有提到任何关于比特币“投资”的回报，它甚至没有提到比特币的价格。</p><p style=\"padding-top: 0px; padding-bottom: 0px;\"><br></p><p style=\"padding-top: 0px; padding-bottom: 0px;\">&nbsp; &nbsp; &nbsp; 它简单地解决了计算机科学中最古老的问题之一，即拜占庭将军（译注：拜占庭容错，拜占庭共识）的问题，从而确立了它在这个过程中的价值。比特币的价值主张从来都不是利润驱动，在最初的几年里持有比特币被认为是“正当的”。</p><p style=\"padding-top: 0px; padding-bottom: 0px;\"><br></p><p style=\"padding-top: 0px; padding-bottom: 0px;\">&nbsp; &nbsp; &nbsp;&nbsp;<span style=\"font-weight: bolder;\">比特币绝对不是一项机密，它是世界上最开放的技术之一</span>。它是开源的，任何人都可以查看代码，任何人都可以为代码做出贡献，任何人都可以自动运行软件并参与到网络中。所有比特币交易的历史，对世界上任何一个人来说都是可见的。</p><p style=\"padding-top: 0px; padding-bottom: 0px;\"><br></p><p style=\"padding-top: 0px; padding-bottom: 0px;\">&nbsp; &nbsp; &nbsp;&nbsp;<span style=\"font-weight: bolder;\">这是人类历史上一种金融体系的范式转移，与欺诈性的投资骗局完全相反</span>。这些骗局大都带有一种含糊不清的承诺，例如高回报，而且资本流入和流出基本都是不透明的，资金交易都被保存在一个秘密的账簿里。</p><p style=\"padding-top: 0px; padding-bottom: 0px;\"><br></p><p style=\"padding-top: 0px; padding-bottom: 0px;\">&nbsp; &nbsp; &nbsp; 从这个角度来看，庞氏骗局也有点类似金字塔骗局，毕竟两者都是通过收割新投资者为老投资者带来回报。</p><p style=\"padding-top: 0px; padding-bottom: 0px;\"><br></p><div class=\"image-desc\" style=\"text-align: center; color: rgb(51, 51, 51);\"><img class=\"uploaded-img\" src=\"https://bizzan.oss-cn-hangzhou.aliyuncs.com/2019/07/11/f9fff9b2-e22a-4709-82be-47479aa3ffca.png\" max-width=\"100%\" width=\"auto\" height=\"auto\" style=\"border-style: none; width: 1713px;\"></div><div class=\"image-desc\" style=\"text-align: center; color: rgb(51, 51, 51);\"><br></div><div class=\"image-desc\"><div class=\"image-desc\"><font color=\"#333333\"><span style=\"font-weight: bolder;\">赚钱不是目的，赚钱也永远不会成为目标&nbsp;</span></font></div><div class=\"image-desc\"><br></div><div class=\"image-desc\"><font color=\"#333333\">&nbsp; &nbsp; &nbsp; 比特币不产生回报，但比特币的价格与稀缺性，导致了其与人们的需求直接相关，这种需求不是强加给别人的。比特币的最大支持者也不会四处询问你有多少钱，然后蛊惑你去投资更多的比特币。加入比特币网络的新用户，不会用新资金去为老用户提供资金。可以毫不客气地说，宣传比特币是庞氏骗局的人，大都懒于去认真研究理解比特币的真正价值。</font></div><div class=\"image-desc\"><br></div><div class=\"image-desc\"><font color=\"#333333\">&nbsp; &nbsp; &nbsp; 在典型的金字塔骗局中，创始人是最富有的。越多人加入，他们就会赚得越多，因为所有的钱都流向了顶层。他们是这个金字塔骗局里面的最初“投资者”，然后吸引其他人投资，把这些资金投入到他们的口袋里。这是他们赚钱的唯一途径，庞氏骗局也是如此。</font></div><div class=\"image-desc\"><br></div><div class=\"image-desc\"><font color=\"#333333\">&nbsp; &nbsp; &nbsp; 比特币的情况正好相反。很多在早期进入的投资者，现在并没有在投资中享受500倍的回报。我认识很多人，他们买了成千上万的比特币，把它们花在诸如披萨、采矿设备、博彩、电子游戏上。说一下我自己的经历，2014年的时候，我在博彩网站上损失了几十个比特币。另外，当我在大学里演讲的时候，也把很多比特币送给别人。放到现在来看，那些损失掉和送出去的比特币，估计也能带来50倍～60倍的收益。</font></div><div class=\"image-desc\"><br></div><div class=\"image-desc\"><font color=\"#333333\">&nbsp; &nbsp; &nbsp; 这些年来，真正持有比特币的人是寥寥无几的。由于比特币的价格暴涨，他们中的一些人现在非常富有，但是他们的净资产并没有以法定货币的形式呈现，而是以方便会计统计的形式。他们用持有的比特币数量来衡量自己的净值，而不是以其法币价值来衡量。</font></div><div class=\"image-desc\"><br></div><div class=\"image-desc\"><font color=\"#333333\">&nbsp; &nbsp; &nbsp; 他们并没有将比特币换成法币来致富，也许一些人会卖出很小一部分以改善自己的生活。但是呢，这并不是我们常人所理解的通过将比特币换成法币来套现，而是将比特币作为交易的媒介，去换取自己想要的东西。他们会用比特币去支付新房子、小汽车，或者就是用比特币去投资。对于那些想拥有比特币的人来说，他们绝不会被强迫或被欺骗，事实上，他们会寻找愿意用比特币支付的人。相信我，大多数人都不想轻易放弃他们的比特币。交易市场，消费者会优先使用廉价货币，保存优质货币，而比特币远比当今世界上任何一种货币都要优越。</font></div><div class=\"image-desc\"><br></div><div class=\"image-desc\"><font color=\"#333333\">&nbsp; &nbsp; &nbsp; 在一个庞氏骗局中，最老的投资者总有一天会把所有的钱都套现出场。这样一来，新进入者就会承受巨大风险，甚至是背黑锅。而对比特币来说，新的投资者就是那些想一夜暴富的人，实际上也是最弱的一方（就是我们口中常说的“韭菜”），他们会在价格出现轻微下跌的迹象时抛售比特币。</font></div><div class=\"image-desc\"><br></div><div class=\"image-desc\"><font color=\"#333333\">&nbsp; &nbsp; &nbsp; 这样一来，真正持有比特币的人也越来越少，或者彻底没了。那个时候，我们会去理解这项技术，并且会发现比特币作为一种高级的价值储存手段，是一种不受限制的、具有审查性的、安全的传输协议。对于我们这些坚信比特币的人来说，终将获利。到那时，我们会很乐意用比特币作为交易媒介，去换取我们想要的东西，或者我们也可以通过比特币去投资一些有价值的项目，甚至是去帮助他人。赚钱不是目的，赚钱也永远不会成为目标。</font></div><div class=\"image-desc\"><br></div><div class=\"image-desc\"><font color=\"#333333\">&nbsp; &nbsp; &nbsp; 最近，一名早期的比特币持有者向安德里亚斯·安东诺普洛斯（Andreas Antonopoulos）捐赠了79个比特币，价值大约为100多万美元（以文章发表时的比特币行情计价）。安德里亚斯也是比特币支持者之一，最近他告诉人们，尽管自己在2012年进入比特币世界，但在世界各地宣讲也让自己花去了很多早期持有的比特币，因此也没能够享受到2017年币价飙升带来的巨大红利。</font></div><div class=\"image-desc\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\"><div class=\"image-desc\"><font color=\"#333333\">&nbsp; &nbsp; &nbsp; 而捐赠者却说，如果没有听安德里亚斯的宣讲，自己就不会开始持有比特币。这位捐赠者之所以给安德里亚斯捐赠价值100万美元的比特币，主要也是出于感激。</font></div><div class=\"image-desc\"><br></div><div class=\"image-desc\"><font color=\"#333333\">&nbsp; &nbsp; &nbsp; 身边其实还有很多这样的例子。最近的一个是菠萝基金——一支拥有5057个比特币的基金，想用这些比特币获取的收益来回报世界。据说，这个基金将会把价值超过9000万美元的比特币赠予那些需要资助的慈善机构和组织。</font></div><div class=\"image-desc\"><br></div><div class=\"image-desc\"><font color=\"#333333\">&nbsp; &nbsp; &nbsp; 对我们来说，比特币是终极游戏。我们从旧的系统中套现出来，只是因为我们面对正在使用的那个系统别无选择。而对于庞氏骗局和金字塔骗局来说，最终如果没有足够的资金做周转，这些骗局也就崩盘了。</font></div><div class=\"image-desc\"><br></div><div class=\"image-desc\"><font color=\"#333333\">&nbsp; &nbsp; &nbsp;&nbsp;</font><font size=\"4\" color=\"#d51228\"><span style=\"font-weight: bolder;\">自发布以来，比特币已经增长了500%</span></font></div></div><div class=\"image-desc\"><br><div class=\"image-desc\" style=\"text-align: center; color: rgb(51, 51, 51);\"><img class=\"uploaded-img\" src=\"https://bizzan.oss-cn-hangzhou.aliyuncs.com/2019/07/11/8e957e0e-1547-4f53-9026-3a260b5fb84d.png\" max-width=\"100%\" width=\"auto\" height=\"auto\" style=\"border-style: none; width: 1713px;\"></div></div><div class=\"image-desc\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\"><font color=\"#333333\"><br></font></div><div class=\"image-desc\"><div class=\"image-desc\" style=\"color: rgb(116, 119, 122); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;\\\\5FAE软雅黑&quot;, Arial, sans-serif; letter-spacing: 1px;\">&nbsp; &nbsp; &nbsp; 你可能在一些地方看过上图，通过这张图，你可以更好地了解世界上所有的货币，包括比特币。在全球范围内，将会有更多的资本流向比特币。其中使用硬币和纸币的国家流通7.6万亿美元，黄金市场7.7万亿美元，股票市场74万亿美元，全球广义货币供应量为90万亿美元。</div><div class=\"image-desc\" style=\"color: rgb(116, 119, 122); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;\\\\5FAE软雅黑&quot;, Arial, sans-serif; letter-spacing: 1px;\"><br></div><div class=\"image-desc\" style=\"color: rgb(116, 119, 122); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;\\\\5FAE软雅黑&quot;, Arial, sans-serif; letter-spacing: 1px;\">&nbsp; &nbsp; &nbsp; 提出这些例子是为了说明，<span style=\"font-weight: bolder;\">比特币的最大上行空间约为180万亿美元</span>，不包括217万亿美元的房地产市场和544万亿美元的衍生品市场。比特币最大发行量是2100万比特币，也就是说比特币单价约合850万美元。这会发生吗?可能不会。那比特币会对这些市场产生巨大影响吗？其实它已经开始影响这些市场了（关于比特币单价达到100万美元以上的看法，值得商榷，这是因为整个区块链的数字token市场发展很蓬勃，未来还有很多可能性）。</div><div class=\"image-desc\" style=\"color: rgb(116, 119, 122); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;\\\\5FAE软雅黑&quot;, Arial, sans-serif; letter-spacing: 1px;\"><br></div><div class=\"image-desc\" style=\"color: rgb(116, 119, 122); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;\\\\5FAE软雅黑&quot;, Arial, sans-serif; letter-spacing: 1px;\">&nbsp; &nbsp; &nbsp; &nbsp;今天的比特币，被“专家”称为“庞氏骗局”，价值高达2000亿美元，也只是全球商业海洋中的一滴水。一些所谓的经济专家称比特币为“庞氏骗局”或“泡沫”，就好像一些专家说“互联网是一个毫无价值的想法”一样，他们只是无知和目光短浅。我们的工作不是试图说服他们并与他们争论，而是保持比特币的价值、投入的时间，为比特币网络的未来发展做贡献。</div><div class=\"image-desc\" style=\"color: rgb(116, 119, 122); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;\\\\5FAE软雅黑&quot;, Arial, sans-serif; letter-spacing: 1px;\"><br></div><div class=\"image-desc\" style=\"color: rgb(116, 119, 122); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;\\\\5FAE软雅黑&quot;, Arial, sans-serif; letter-spacing: 1px;\">&nbsp; &nbsp; &nbsp; 比特币打开了潘多拉的创新魔盒，在短短8年时间里，它创造了规模5000亿美元的市场，在全球范围内创造了巨大的价值。这个价值并不是因为新投资者的入局，而是因为成千上万的创业公司和企业创造了数以万计的工作岗位，为用户、基础设施、硬件、软件和应用程序提供了价值。</div><div class=\"image-desc\" style=\"color: rgb(116, 119, 122); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;\\\\5FAE软雅黑&quot;, Arial, sans-serif; letter-spacing: 1px;\"><br></div><div class=\"image-desc\" style=\"color: rgb(116, 119, 122); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;\\\\5FAE软雅黑&quot;, Arial, sans-serif; letter-spacing: 1px;\">&nbsp; &nbsp; &nbsp; 比特币的真正价值不体现于暴涨的币价，其价值主张在于带来的一个又一个效应。比特币不会解体，因为真正理解比特币价值的人永远不会选择去兑现。我们不想要现金，我们想要比特币。为什么我们要用一种有限的、稀缺的、有价值的资产来换取无限印刷的纸张呢?</div><div class=\"image-desc\" style=\"color: rgb(116, 119, 122); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;\\\\5FAE软雅黑&quot;, Arial, sans-serif; letter-spacing: 1px;\"><br></div><div class=\"image-desc\" style=\"color: rgb(116, 119, 122); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;\\\\5FAE软雅黑&quot;, Arial, sans-serif; letter-spacing: 1px;\">&nbsp; &nbsp; &nbsp;&nbsp;<span style=\"font-weight: bolder;\">比特币不是泡沫，而是刺破泡沫的针。对于我们和其他成千上万的人来说，我们不是在等待出口，比特币就是出口。</span></div><div><span style=\"font-weight: bolder;\"><br></span></div></div></div></div>','2020-09-19 07:13:11','',NULL,1,0,6,'比特币是庞氏骗局吗？','CN'),(13,'admin','<p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">本文将告诉你如何在</span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">QIBIT</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">通过人民币、美元等法定货币购买比特币、以太坊等数字货币。本文也为新手准备了一些概念普及知识，见文末附文。</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp;</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><b><span style=\"font-family