Helvetica\">以下推荐法币</font>OTC交易平台为第三方交易平台，</span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">QIBIT</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">(</span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">QIBIT</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">)仅提供参考推荐，不对资金安全做保证，请在充分了解的前提下，慎重使用第三方OTC交易平台进行交易。</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt 36pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">在第三方</font>OTC交易平台兑换数字货币后，您可以通过“提币”或“转账”将数字货币充值到您在</span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">QIBIT</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">(</span><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">QIBIT</span><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">)交易平台的账户。</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt 36pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Calibri; letter-spacing: 1.15pt; font-size: 12pt;\">&nbsp;</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt 36pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">1）、OTCBTC场外交易平台（人民币）</span><sp