lass=\"p\" style=\"margin: 0pt 72pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\">OTCBTC，成立于2017年9月，是由一群爱好区块链行业的台湾团队，结合交易所、ICO、金融外汇应用的开发经验，运用严格KYC程序、公平的评分机制等措施，专注于为全球用户提供安全易用、便捷可靠的区块链服务，建立一个提供虚拟数字货币交易平台。</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp;</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt 36pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">2）、火币点对点平台（人民币）</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt 72pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: 宋体; color: rgb(132, 146, 156); letter-spacing: 0pt; font-size: 12pt;\"><font face=\"宋体\">官网地址</font></span><span style=\"font-family: 宋体; color: rgb(81, 90, 110); letter-spacing: 0pt; font-size: 9pt;\">&nbsp;</span><a href=\"#/content/helpManage/_blank\"><span class=\"15\" style=\"font-family: 宋体; color: rgb(0, 155, 244); letter-spacing: 0pt; font-size: 12pt;\">https://otc.huobi.pro</span></a><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt 72pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\"><font face=\"宋体\">火币全球专业站点对点交易平台（以下简称</font>“点对点平台”）：是火币全球专业站设立关于数字资产场外交易的平台，您可以在点对点平台创建出售/购买数字资产的卖单/买单，与意向交易对方达成交易，以满足用户间交换数字资产的需求。</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt 72pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Calibri; letter-spacing: 1.15pt; font-size: 12pt;\">&nbsp;</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0pt 72pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">3）、Circle Trade（美元）</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt 72pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: 宋体; color: rgb(132, 146, 156); letter-spacing: 0pt; font-size: 12pt;\"><font face=\"宋体\">官网地址</font></span><span style=\"font-family: 宋体; color: rgb(81, 90, 110); letter-spacing: 0pt; font-size: 9pt;\">&nbsp;</span><a href=\"#/content/helpManage/_blank\"><span class=\"15\" style=\"font-family: 宋体; color: rgb(0, 155, 244); letter-spacing: 0pt; font-size: 12pt;\">https://www.circle.com/en/trade</span></a><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt 72pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\"><font face=\"宋体\">作为世界上最大的流动资产提供商和场外交易（</font>OTC）数字资产市场之一，在Circle比特币交易订单最低额度已经高达50万美元。这家在都柏林注册的公司在2018年3月宣布，它正在招聘100名新员工以改善Poloniex的技术、运营和客户支持。此外，该公司还提到计划雇用25-35名员工来支持其在亚洲的业务。</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt 72pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Calibri; letter-spacing: 1.15pt; font-size: 12pt;\">&nbsp;</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0pt 72pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">4）、LocalBitcoins</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0pt 72pt 0pt 102pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: 宋体; color: rgb(132, 146, 156); letter-spacing: 0pt; font-size: 12pt;\"><font face=\"宋体\">官网地址</font></span><span style=\"font-family: 宋体; color: rgb(81, 90, 110); letter-spacing: 0pt; font-size: 9pt;\">&nbsp;</span><a href=\"#/content/helpManage/_blank\"><span class=\"15\" style=\"font-family: 宋体; color: rgb(0, 155, 244); letter-spacing: 0pt; font-size: 12pt;\">https://localbitcoins.net/zh-cn/</span></a><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0pt 36pt 0pt 66pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp;</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0pt 36pt 0pt 66pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">5）、COINCOLA</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0pt 72pt 0pt 102pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: 宋体; color: rgb(132, 146, 156); letter-spacing: 0pt; font-size: 12pt;\"><font face=\"宋体\">官网地址</font></span><span style=\"font-family: 宋体; color: rgb(81, 90, 110); letter-spacing: 0pt; font-size: 9pt;\">&nbsp;</span><a href=\"#/content/helpManage/_blank\"><span class=\"15\" style=\"font-family: 宋体; color: rgb(0, 155, 244); letter-spacing: 0pt; font-size: 12pt;\">http://www.coincula.com/about</span></a><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt 72pt 12pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: 宋体; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\">CoinCola是一家位于香港的数字货币场外、币币交易平台。平台成立的宗旨是为用户提供最优质的数字货币交易体验。</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt 72pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Calibri; letter-spacing: 1.15pt; font-size: 12pt;\">&nbsp;</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">附录：</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp;</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><b><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\">1、什么是交易所？</span></b><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp; &nbsp; &nbsp; 如果你手持人民币或者美元，想购买比特币或其他数字货币时，首先，你需要找到一个拥有比特币并且愿意卖给你的人，而在我们身边可能持有比特币的人很少、或者持有但不愿意卖、或者愿意卖的数量不够你买。类似的情形，当你有比特币，想兑换成人民币或者法币的时候；或者有比特币，想兑换成其他数字货币的时候。为了满足大家交易的需求，就形成了基于互联网的线上交易场所。</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp; &nbsp; &nbsp; 线上交易所目前有三类：中心化撮合式交易所、OTC场外交易和去中心化交易，适合新人的主要是中心化撮合式交易所和OTC场外交易。其中OTC场外交易所主要的业务是对接法币与数字货币的交易，比如人民币与比特币之间的交换；而中心化撮合式交易所主要业务内容是完成币币之间的兑换，比如比特币与以太坊之间的兑换。</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp;</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp;</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><b><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\">2、什么OTC交易？</span></b><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp; &nbsp; &nbsp; OTC的全称是Over the counter，即柜台交易的意思。在传统金融场景里，如果仅仅有股市（如A股、纳斯达克等）这样制度完善、监管严格的股权交易方式，那么大部分无法上市的公司就很难完成股权转让及交易，这时候就有了场外交易的需求，它不需要那么严格的制度限制，没有那么严格的监管，但是更加方便了交易方的交易，只要大家遵从一个更大范围的制度——法律，如合同法，也就可以了。</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp; &nbsp; &nbsp; 那么前面提到，我们在身边很难找到合适的人完成兑换交易，这时候就出现一个又一个平台聚集了一些需要兑换的人。你可以视之为中介平台，在这样的平台网站或APP上，你可以看到别人的挂单，你也可以参与买卖。如下图：</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp;</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;text-indent:0.0000pt;padding:0pt 0pt 0pt 0pt ;\nmso-pagination:widow-orphan;text-align:center;\"><span style=\"font-family: Helvetica; color: rgb(51, 51, 51); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp;</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;text-indent:0.0000pt;padding:0pt 0pt 0pt 0pt ;\nmso-pagination:widow-orphan;text-align:center;\"><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\">&nbsp;</span></p><p class=\"MsoNormal\" align=\"center\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:0.0000pt;\nmargin-left:0.0000pt;text-indent:0.0000pt;padding:0pt 0pt 0pt 0pt ;\nmso-pagination:widow-orphan;text-align:center;\"><img width=\"1109\" height=\"625\" src=\"file:///C:\\Users\\ADMINI~1\\AppData\\Local\\Temp\\ksohtml4492\\wps5.jpg\"><span style=\"font-family: Helvetica; color: rgb(51, 51, 51); letter-spacing: 1.15pt; font-size: 10.5pt;\">&nbsp;</span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><b><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\">3、撮合式交易所与OTC交易的区别是什么？</span></b><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp; &nbsp; &nbsp; OTC交易的主要功能是完成人民币/美元等法币与数字货币的兑换，而中心化撮合式交易所则是快速的撮合式交易，它不涉及到数字货币与法币之间的兑换，跟传统的股票交易市场没什么本质区别。</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp;</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp;</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><b><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 12pt;\">4、什么是法币，什么是稳定币？</span></b><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp; &nbsp; &nbsp; 法币（Fiat Currency）是以国家政府信用背书，以法律为保障发行的货币，也就是法定货币，如人民币、美元、卢布等就属于法币。</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp; &nbsp; &nbsp; 稳定币是数字货币领域为了方便交易而发行的数字货币，比如USDT、PAX、EUSD等等，他们都可以完成与美元法币接近1:1的兑换，在数字货币领域，因为这类币的价格很稳定，不会像比特币那样猛涨猛跌，所以就称之为稳定币。</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\">&nbsp;</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"p\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Helvetica; color: rgb(116, 119, 122); letter-spacing: 0.75pt; font-size: 10.5pt;\"><font face=\"Helvetica\">搞清了上面三个概念，也就知道如何参与数字货币交易了：第一步是通过一些途径（如</font>OTC交易）将法币换成数字货币，第二步是交易数字货币。</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0pt; text-indent: 0pt; padding: 0pt;\"><span style=\"font-family: Calibri; letter-spacing: 1.15pt; font-size: 10.5pt;\">&nbsp;</span><span style=\"font-family: Helvetica; letter-spacing: 1.15pt; font-size: 10.5pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-fareast-font-family:宋体;\nmso-bidi-font-family:\'Times New Roman\';font-size:10.5000pt;mso-font-kerning:1.0000pt;\"><o:p>&nbsp;</o:p></span></p>','2020-09-24 18:32:24','',NULL,1,0,0,'如何用人民币/美元买卖数字货币？','CN'),(14,'admin','<h3 style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:22.5000pt;\nmargin-left:0.0000pt;text-indent:0.0000pt;padding:0pt 0pt 0pt 0pt ;\nmso-pagination:widow-orphan;mso-line-height-alt:12pt;\"><b><span style=\"font-family: Helvetica; color: rg